(30, 1, 'web_intro', 'Introduction', '<p style="text-align: justify;"><strong><span style="font-size: small;"><span style="color: #ff0000;">Welcome to Freightidea,&nbsp;The First Freight Online in Cambodia!</span></span></strong></p>\r\n<p style="text-align: left;">Freightidea.com&nbsp;is the Cambodia based, the first and original&nbsp;freight&nbsp;online&nbsp;that offer FREE&nbsp;QUOTATION, consulting and&nbsp;coaching about&nbsp;transportation. We will&nbsp;provide or share&nbsp;idea of freight to importers and exporters&nbsp;with powerful&nbsp;platform to trim the freight cost. To have the quotation for <a title="aifreight quotation" href="http://localhost/index.php?option=com_content&amp;view=article&amp;id=113&amp;Itemid=83&amp;lang=en">Airfreight</a>, <a title="FCL" href="http://localhost/index.php?option=com_content&amp;view=article&amp;id=116&amp;Itemid=87&amp;lang=en">Seafreight FCL</a>, <a title="LCL" href="http://localhost/index.php?option=com_content&amp;view=article&amp;id=115&amp;Itemid=86&amp;lang=en">Seafreight LCL</a> and <a title="Trucking" href="http://localhost/index.php?option=com_content&amp;view=article&amp;id=114&amp;Itemid=85&amp;lang=en">Trucking</a>, just click on the link&nbsp;and fill in the details that''s all.</p>\r\n<p style="text-align: left;">Freightidea&nbsp;also created a freight directory for&nbsp;all transportation companies including freight forwarders, trucking companies, shipping lines and&nbsp;airlines to list in their company profile. This&nbsp;can help customers to find the freight&nbsp;providers more easier. Search for your company profile first and if you cannot find one, please send us your&nbsp;company profile so that our team can update for you. It is FREE of charge.</p>', '[]', '2016-01-20 00:00:00', 1, '2017-05-02 15:09:46', 1, NULL, 0),
(6, 2, 'web_definition', 'Visit Cambodia', '<p>Land 3A, St. 169, Sangkat Veal Vong, Khan 7 Makara, Phnom Penh, Kingdom of Cambodia<br />Email:&nbsp;<a href="mailto:info@visitcambodia.travel">info@visitcambodia.travel</a></p>', '[]', '2015-08-25 11:44:15', 1, '2017-06-02 11:13:08', 1, NULL, 1),
(57, 5, 'embassy', 'Embassy or Consulate in Cambodia', '<p>Here you find the complete list of countries with an <strong>embassy or consulate in Cambodia</strong> with contact information including address, phone number and website address.</p>\r\n<p>By the way: on the boulevard along the Tonle Sap in Phnom Penh you see a row of flags. These flags on the riverside boulevard are of countries and international organizations <strong>represented</strong> in Cambodia.</p>\r\n<p>Find the flag of your country! Some foreign embassies represent other countries as well.</p>\r\n<table style="width: 100%; background-color: #ffffff;" border="1" cellspacing="0" cellpadding="10">\r\n<tbody>\r\n<tr>\r\n<td class="table2" style="padding: 10px; background-color: #1f79a6; text-align: center;"><span style="color: #ffffff;"><strong>Embassy</strong></span></td>\r\n<td class="table2" style="padding: 10px; background-color: #1f79a6; text-align: center;"><span style="color: #ffffff;"><strong>Address</strong></span></td>\r\n<td class="table2" style="padding: 10px; background-color: #1f79a6; text-align: center;"><span style="color: #ffffff;"><strong>Phone</strong></span></td>\r\n</tr>\r\n<tr>\r\n<td class="table2" style="padding: 10px;"><img class=" size-full wp-image-209" src="http://www.camboguide.com/nw/wp-content/uploads/2010/07/australia.png" alt="" width="22" height="11" />&nbsp;Australia</td>\r\n<td class="table2" style="padding: 10px;">11, Street 254</td>\r\n<td class="table2" style="padding: 10px;">+855(0)23 &ndash; 213 470</td>\r\n</tr>\r\n<tr>\r\n<td class="table2" style="padding: 10px;"><img class=" size-full wp-image-210" src="http://www.camboguide.com/nw/wp-content/uploads/2010/07/belgium.png" alt="" width="22" height="15" />&nbsp;<strong>Belgium</strong></td>\r\n<td class="table2" style="padding: 10px;">313 Sisowath Quay</td>\r\n<td class="table2" style="padding: 10px;">+855(0)23 &ndash; 214 024</td>\r\n</tr>\r\n<tr>\r\n<td class="table2" style="padding: 10px;"><img class=" size