(13, 2, 'developer', 'អ្នកបច្ចេកទេសបង្កើត', '<p>វេបសាយ&nbsp;<strong>រង្វាន់ធុរកិច្ចបៃតងក្នុងវិស័យទេសចរណ៍</strong> ត្រូវបានបង្កើតឡើងដោយ លោក <strong>អ៊ុង សិរីវុធ&nbsp;</strong>ដែលជាអ្នកបច្ចេកទេសកំរិចខ្ពស់នៃការបង្កើតប្រព័ន្ធវេបសាយ នៃក្រុមហ៊ុន GIGB ។&nbsp;</p>\r\n<p>ព័ត៌មានទំនាក់ទំនង៖<br />- ទូរស័ព្ទ: (+855) 17 487 157</p>\r\n<p>- អ៊ីម៉េល: sereyvuth_ung@yahoo.com</p>', NULL, '2015-10-01 16:30:55', 1, NULL, NULL, 0, 1),
(18, 1, 'website_purpose', 'គោលបំណង', '<p>មជ្ឈមណ្ឌល​ទ្រទ្រង់​ China Ready បង្កើត​ឡើង​ក្នុង​គោល​បំណងគាំទ្រដល់​នយោបាយ​របស់​ក្រសួង​ទេសចរណ៍​​លើទីផ្សារ​ចិន​ ដែល​បាន​ដាក់​ចេញ​នៅក្នុង​សៀវ​ភៅស​ ស្តីពី &ldquo;China Ready&rdquo;​​​ សម្រាប់​ឧស្សាហកម្ម​ទេសចរណ៍​​កម្ពុជា។ ក្នុង​ទិសដៅ​នេះ មជ្ឈមណ្ឌល​ទ្រទ្រង់​ China Ready ក្នុង​ក្រប​ខណ្ឌ​ជំនាញ​របស់​ខ្លួន​ និង​ផ្តល់​ការ​សិក្សា​ស្រាវ​ជ្រាវ​ទីផ្សារ​ទេសចរ​ចិន វិភាគ​និន្នាការ​របស់​ទេសចរចិន និង​ផ្តល់​ការ​ប្រឹក្សា​យោបល់​លើការ​វិនិយោគ​លើ​កម្ចី​សម្បទាន​ទេសចរ​ណ៍​សម្រាប់​បំពេញ​តម្រូវការ​ទេសចរ​ចិន ការ​បណ្តុះបណ្តាល​ភាសា ក៏​ដូច​ជា​វប្បធម៌ទំនៀម​ទំលាប់​​ដល់​ប្រតិបត្តិករ​ទេសចរណ៍​ ដែល​​តម្រង់​ទិស​ដៅ​រក​ទីផ្សារ​ចិន​ និង​ជួយ​ផ្សព្វផ្សាយ​ទីផ្សារ​ចិន​ឱ្យ​បាន​កាន់​តែ​ទូលំ​ទូលាយ​ ពិសេស​នៅក្នុង​បណ្តាញ ​ដែល​​ទេសចរចិន​និយម​ប្រើប្រាស់​។</p>\r\n<p>មជ្ឈមណ្ឌល​ទ្រទ្រង់ China Ready ក៏មាន​ភារកិច្ច​ជួយ​សម្រប​សម្រួល​ដើម្បី​ឱ្យ​អាជីវកម្ម​ទេសចរណ៍​ទទួល​បាន​ការ​ទទួល​ស្គាល់​ពី​ការ​បញ្ជាក់​គុណភាព​ China Ready ឡាប៊ែល។</p>', '[]', '2016-01-20 00:00:00', 1, '2017-05-02 15:09:23', 1, NULL, 0),
