(63, 4, 'romantic', 'BEST ROMANTIC EVER', '<p>Cras sit amet varius velit. Maecenas porta condimentum tortor at sagittis. Cum sociis natoque penatibus et magnis dis</p>', '[{"filename":"add_attachment_0_1493022453.jpg","des":""}]', '2017-04-24 15:27:33', 1, NULL, NULL, 442, 1),
(64, 4, 'festival', 'Festivals', '<p><img style="float: left; margin: 0px 10px; width: 40%;" src="http://visitcambodia.localhost/upload/post_attachment/resized/add_attachment_0_1493022821.jpg" alt="" width="40%" />The Kingdom of Cambodia has a wealth of traditional and cultural festivals dated according to the Cambodian lunar calendar. All of these festivals are influenced by the concepts of Buddhism, Hinduism, and royal cultures. The festivals, which serve as a source of great joy, merriment and Cambodia&rsquo;s national colors, play a major role in influencing tourists&rsquo; opinions, behaviors, and options. Most of these are a time of great rejoicing for the predominantly urban and the rural populace. Nowadays the whole nation unites in understanding its cultural values and traditions. On these pages, are some of the important celebrations organized during the year.</p>\r\n<p><img src="http://visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1516943272.png" width="60%" height="70%" /><img src="http://visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1493022821.jpg" alt="" width="60%" height="70%" /></p>\r\n<h1>Royal Ploughing Ceremony</h1>\r\n<p>The Royal Ploughing Ceremony, or ''Bon Chroat Preah Nongkoal'' in the Khmer language, is solemnly celebrated at the beginning of the sowing and planting season. Every year in May, this cultural ceremony takes place at the park in front of the National Museum (next to the Royal Palace). Cambodia has deep connection with earth and farming. There is a deep astrological belief that royal oxen known in Khmer as Usapheak Reach, have an instrumental role in determining the fate of the agricultural harvest each year.</p>\r\n<p>Traditionally, the King Meak, representing the king of Cambodia, ploughs the field whilst the Queen, the Preah Mehuo, sows seeds from behind. The field is ceremoniously ploughed three times around. The royal servants then drive the royal oxen to seven golden trays containing rice, corn, sesame seeds, beans, grass, water, and wine to feed. The royal soothsayers interpret what the oxen have eaten and predict a series of events including epidemics, floods, good harvests, and excessive rainfall. At this festival, both men and women wear brightly colored Khmer traditional costume.</p>', '[{"filename":"add_attachment_0_1493022821.jpg","des":""},{"filename":"add_attachment_0_1516943272.png","des":""},{"filename":"","des":""}]', '2017-04-24 15:33:41', 1, '2018-01-26 12:24:04', 5, 295, 1),
(65, 4, 'art_craft', 'Art and Craft', '<p><img style="float: right; margin: 0px 0px 10px 10px;" src="http://visitcambodia.localhost/upload/post_attachment/resized/add_attachment_0_1493022879.jpg" alt="" width="40%" />In finibus vehicula lorem, in tempor diam convallis non. Curabitur vel risus vitae urna auctor aliquam.</p>\r\n<p>{{event,1}}</p>', '[{"filename":"add_attachment_0_1493022879.jpg","des":""}]', '2017-04-24 15:34:39', 1, '2017-04-27 11:19:33', 1, 335, 1),
(66, 4, 'shopping', 'shopping', '<p><strong>PHSAR THMEY MARKET</strong></p>\r\n<p>Phsar Thmey, better Known as the Central Market, is a unique built in 1937, Phsar Thmey literally means &ldquo;New Market&rdquo;. The location where the Central Market now sits was once a swamp area and occupied by a lake known as beng Decho. Today, this beautiful market has become a prominent landmark in Phnom Penh.</p>\r\n<p>This is a stylish Art D&eacute;cor rotunda with wing s extending in four different directions, the dome is said to be among the largest in the world. The four wings and the beamless dome are very well ventilated by the high ceiling, and it&rsquo;s an anthill of activity on any given day. The market sells almost anything from fresh produce to souvenirs and clothes. Tourists can certainly get some interesting bargains and unique finds</p>\r\n<p>&nbsp;</p>\r\n<p><img src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1499159622.jpg" alt="" width="50%" height="50%" /></p>\r\n<p>&nbsp;</p>\r\n<p><strong>RUSSIAN MARKET (TOUL TUM POUNG MARKET)</strong></p>\r\n<p>The Toul Tum Poung market is often referred to as the Russian Market. This is so named because of its popularity among Russian expatriates during the 1980s. The market is popular to collectors of genuine antiques; also for those looking for good reproductions.</p>\r\n<p>Although this market is not as attractive in looks as the Central Market, it has a larger and more varied offering of souvenirs, curios and silk materials,</p>\r\n<p>This probably the best place to find branded factory over-run.</p>\r\n<p>&nbsp;</p>\r\n<p><img src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1499160759.jpg" alt="" width="50%" height="50%" /></p>', '[{"filename":"add_attachment_0_1493023022.jpg","des":""},{"filename":"add_attachment_0_1499159622.jpg","des":""},{"filename":"add_attachment_0_1499160759.jpg","des":""}]', '2017-04-24 15:37:02', 1, '2017-07-04 16:41:36', 5, 386, 1),
(67, 4, 'nightlife', 'Nightlife', '<p><img style="float: right;" src="http://visitcambodia.localhost/upload/post_attachment/resized/add_attachment_0_1493023341.jpg" alt="" width="40%" /><strong>A HEADY DUSK-TO-DAWN NIGHTLIFE IN PHNOM PENH</strong></p>\r\n<p>Phnom Penh is famous for some of the most vibrant nightfife in all of Southeast Asia; its a "must see" for nightlife hawks as this is indeed a surprisingly neat little party town.</p>\r\n<p><img src="http://visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1516093118.jpg" alt="" width="50%" height="50%" /></p>\r\n<p>The entire vicinity around the riverfront sports the greatest number of fun place with dozens of bars and restaurants stretching along Sisowat Quay and up the side streets.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '[{"filename":"add_attachment_0_1516093118.jpg","des":""}]', '2017-04-24 15:42:21', 1, '2018-01-16 16:05:52', 5, 341, 1),
(53, 1, 'friendly', 'Friendly', '<p>Cambodian people are very much friendly but only they are a bit shy.</p>', '[{"filename":"","des":""}]', '2017-03-30 10:48:21', 1, NULL, NULL, 279, 1),
(52, 5, 'dos_and_donts', 'Dos and don''ts', '<p>People in Cambodia are well-known for their hospitality and warmth. Out of respect, visitors to the Kingdom should take care to observe local customs and practices. You may find it useful to familiarize yourself with the following common dos and don''ts before embarking on your trip to Cambodia.</p>\r\n<h4><strong>DOs in Cambodia</strong></h4>\r\n<ul>\r\n<li>Ask for permission before taking photographs of any Cambodian people or monks.</li>\r\n<li>It is customary to remove your shoes when entering a place of worship such as a pagoda or temple. Additionally, visitors should dress appropriately when inside a religious site (upper arms and legs should be covered, hats removed).</li>\r\n<li>It is respectful to remove your shoes when entering someone&rsquo;s home.</li>\r\n<li>Though not always expected, a respectful way of greeting another individual is to bow the head slightly with hands pressed together at the chest (known as &ldquo;Sampeah&rdquo;).</li>\r\n<li>If invited to dine in a Cambodian family&rsquo;s home, it is polite to bring a small gift for the host such as fruit, dessert, or flowers.</li>\r\n<li>If invited to attend a Cambodian wedding, it is customary to bring cash as a wedding gift.</li>\r\n<li>When using a toothpick at the table, use one hand to cover your mouth.</li>\r\n<li>Keep business cards ready, and present them with both hands. Accept business cards with both hands.</li>\r\n</ul>\r\n<h4><strong>DON''Ts in Cambodia</strong></h4>\r\n<ul>\r\n<li>Don''t use your feet to point at someone.</li>\r\n<li>Don''t touch a Cambodian person on the head.</li>\r\n<li>Don''t begin eating if you are a guest at a dinner and the host has yet to take a bite.</li>\r\n<li>Women should never touch male monks or hand something directly to them.</li>\r\n<li>Keep public displays of affection to a respectful minimum.</li>\r\n</ul>\r\n<h4><strong>Commonsense Practices</strong></h4>\r\n<ul>\r\n<li>Do not litter; keep our community clean and safe</li>\r\n<li>Plastic bags can be hazardous; dispose them properly</li>\r\n</ul>', '[{"filename":"add_attachment_0_1492767542.jpg","des":""}]', '2017-03-24 15:18:01', 1, '2017-04-21 16:58:59', 1, 385, 1),
(46, 2, 'home_slider', 'home slider pictures', '<p>home slider pictures</p>', '[{"filename":"add_attachment_0_1472702765.jpg","des":""},{"filename":"add_attachment_1_1472702765.jpg","des":""},{"filename":"add_attachment_2_1472702765.jpg","des":""}]', '2016-09-01 11:06:05', 1, NULL, NULL, 3, 1),
(48, 1, 'About_Cambodia', 'ABOUT CAMBODIA', '<h4>&nbsp;</h4>\r\n<h4>&nbsp;</h4>\r\n<h4><strong>INTRODUCTION</strong></h4>\r\n<p>The Kingdom of Cambodia, formerly Kampuchea, is a Southeast Asian nation that borders Thailand, Laos, Vietnam, and the Gulf of Thailand. The capital city is Phnom Penh.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Location</strong></p>\r\n<p>&nbsp;</p>\r\n<p><br />Cambodia is located in Southeast Asia in-between Thailand and Veitnam with Laos to the North.</p>\r\n<p>Its serene coastline borders the Gulf of Thailand.Cambodia is a tropical country and its southernmost point is a mere 10 above the equator.It cover 181,035 square kilometers.</p>\r\n<p>There are mountains to the North and East but the land is mostly flat; perfect for rice cultivation . Indeed, Cambodia Jasmin Rice recently neon the world''s Best Rice competition three times in row.The green rice fields and trees are fed by the giant Tonle Sap Lake and famous Mekong River-the 12th longest river in the world--that flows through the country and the capital city,Phnom Penh.<br /><br />Minerals, oil and natural gas deposits were recently found beneath Cambodia''s territorial waters- valuable assets that will surely contribute to this burgeoning economy.</p>\r\n<p><img src="http://www.visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1508902087.png" alt="" width="50%" height="50%" /></p>\r\n<p><strong>CLIMATE</strong></p>\r\n<p><br />Cambodia''s climate is hot and sunny all year round. Like most Southeast Asian countries there are two season-the rainy season and the dry season. The rains fall May-October and it is dry during November-April. December and January are the coolest months and April is the hottest. The average temperature is 27-28<sup>0 </sup>C. During the rainy season downpours are limited to a couple of hours a day in the late afternoon or overnight so many tourists still come during this time to enjoy the country.</p>\r\n<p>&nbsp;<strong>Population</strong></p>\r\n<p>Cambodia&rsquo;s total population is roughly 15.95 million people, 90% of which belong to the khmer ethnic group. Many foreigners live here too and some ethnic groups have made their home in Cambodia for centuries including the Chams ( Muslim khmer ), Chinese, Indian, Vietnamese, Thai, Kuoy, Stieng and Tamil. Chinese people have a strong influence particularly in the business sector. Khmer is official language of Cambodia.</p>\r\n<p><img src="http://www.visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1508903191.jpg" alt="" width="50%" height="50%" /></p>\r\n<p><strong>RELIGION</strong></p>\r\n<p>Theravada Buddhism is the oldest surviving from of the religion and is practiced by 90% of the Cambodia population. Cambodian Buddhism shares much with other Theravada countries but has many notable and unique qualities. Buddha statues are revered in Cambodia and visitors are kindly asked to respect the customs surrounding these items ( such as not pointing your feet towards a Buddha statue and dressing respectfully in temple ). Islam, Christianity and Hinduism exist harmoniously alongside the main religion.</p>\r\n<p><strong>Language</strong></p>\r\n<p>Khmer is the official language of Cambodia. It is one of the oldest Language in the region and is derived from the Mon-Khmer (Austro-Asiatic ) language family. It is notable for its extensive alphabet with 33 consonants, 23 vowels and 12 independent vowels. Unlike other Asian language, Khmer is not tonal and so is quite approachable for foreigners. While learning simple phrases is approachable for foreigners. While learning simple phrases is appreciated, English, French and Mandarin are widely spoken.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>National Flag</strong></p>\r\n<p>The Cambodian national flag was adopted in its current in 1948 when Cambodia broke with French protectorate. It was readopted in 1993 following the end of the civil war. The Angkor Wat temple represents the Buddhist religion of the country along with the dignity and heritage of the Khmer people. The blue stripes represent the king and also stand for liberty and co-operation. The red represents the people and also stands for bravery. In short, the flag sums up the slogan: "nation,religion,king."</p>\r\n<p>&nbsp;<img src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_3_1497862564.png" alt="" width="50%" height="50%" /></p>\r\n<p>&nbsp;</p>\r\n<p><strong>National Flower</strong></p>\r\n<p>Romdul (Sphaerocoryne affinis ) is the national flower of Cambodia. It is a small, pale yellow flower with a heady fragrance that can travel far and wide in the wind. Cambodia women have often been compated to the Ramduol flower and such is the regard for this pretty thing that several regions have been named after it . The Romduol plant can grow to a height of 12 metters and many have been planted in Cambodia''s public parks.</p>\r\n<p><img src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_2_1497862564.jpg" alt="" width="50%" height="50%" /></p>\r\n<p><strong>Money exchange</strong></p>\r\n<p>Cambodia riel(KHR) is the official currency. However, the US dollars are in common use. Most businesses in the country ,especially hotals,restaurants, airlines, markets and souvenir shops actually set their prices in US dollars. Change of less than one dollar is given in riel. Do inspect the bills when accepting money . Marred riel is acceptable tender, but the tiniest tear in a large US note renders it unusable in Cambodia.</p>\r\n<p><img src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_1_1497862564.jpg" alt="" width="50%" height="50%" /></p>\r\n<p><strong>Electricity</strong></p>\r\n<p>Voltage: 230 V</p>\r\n<p>Frequency: 50 Hz</p>\r\n<p>Picture- Power sockets</p>\r\n<p>The standard voltage in Cambodia is 230 V and the standard frequency is 50 Hz.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Purchasing a phone number/SIM card</strong></p>\r\n<p>You can purchase a SIM card and telephone number outside the arrival terminal at the Phnom Penh International Airport or from any of the many phone shops scattered across town. Valid passport and visa are required.</p>\r\n<p><strong>Banks and ATMs</strong></p>\r\n<p>Banks in Cambodia provide currency and travelers check exchange, credit card advance, telegraphic transfers and all regularf banking service. Most banks are open from8:00 to 3:00 or 4:00pm for some; Mondays through Fridays. Some are open Saturday morning until 11:30AM</p>\r\n<p>ATMs,located all across town , are active 24/7 and &nbsp;accept Visa and MasterCard. The machinesdispense one''s preference.</p>\r\n<p>At the time of printing, the average rate of exchange is 4,000riel to 1USD.</p>\r\n<p>&nbsp;</p>\r\n<p><img src="http://visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1508831121.jpg" alt="" width="438" height="291" /></p>\r\n<p><strong>Credit Cards</strong></p>\r\n<p>Visa, MasterCard and ANZ cards are the most jwidely accepted credit cards in Cambodia. AMX is accepted at a few places while Diners clube at fewer places. Many businesses charge a fee on credit card payment.</p>\r\n<p><strong>Travelers checks</strong></p>\r\n<p>Travelers checks are accepted at most banks, major hotels and some money changers.</p>\r\n<p><strong>Cash Transfers</strong></p>\r\n<p>''Instant'' cash transfers can be done through Western Union or MoneyGram. ordinary telegrapnhic transfers are available at all major banks.</p>\r\n<p><strong>Visa on Arrival</strong></p>\r\n<p>Visa on Arrival can be&nbsp; obtained at the Visa Counter upon arrival at the Phnom Penh International Airports. However, please note that not all foreign passport holders can apply for a visa on arrival. It is therefore important to check with the nearest Royal Embassy of Cambodia for the specific visa requirements for the countries in question.</p>\r\n<p><strong>TRANSPORTATION</strong></p>\r\n<p>The country possesses twenty-six airfields, of which only thirteen were usable in the mid-1980s. Eight airfields had permanent-surface runways. Phnom Penh International Airport in Phnom Penh is the largest airport; it also serves as the main base for the renascent Cambodian Air Force. Cambodia''s second largest airport is Angkor International Airport in the major tourist city of Siem Reap. Tourist traffic into Angkor International Airport saw passenger numbers overtake those of Phnom Penh in 2006, the airport now being the country''s busiest. Cambodia also opened a new Soviet-built airfield at Ream, Sihanoukville International Airport in late 1983, which never saw commercial air traffic until now. There are additional airports in Battambang and Stung Treng. The new national airline Cambodia Angkor Air was launched in 2009, with a large financial investment from Vietnam Airlines. And Aero Cambodia Airline started business in 2011 offering flights to all airports and water ways with seaplanes.</p>\r\n<p>{{place,11}}{{place,7}}{{place,3}}</p>', '[{"filename":"add_attachment_0_1493798993.jpg","des":""},{"filename":"add_attachment_1_1497862564.jpg","des":""},{"filename":"add_attachment_2_1497862564.jpg","des":""},{"filename":"add_attachment_3_1497862564.png","des":""},{"filename":"add_attachment_0_1508831121.jpg","des":""},{"filename":"add_attachment_0_1508902087.png","des":""},{"filename":"add_attachment_0_1508903191.jpg","des":""}]', '2017-03-24 14:19:27', 1, '2018-01-15 11:02:14', 5, 1006, 1),
(49, 1, 'culture_tradition', 'CULTURE AND TRADITION', '<h4 style="text-align: justify;">Customs and Tradition</h4>\r\n<p style="text-align: justify;">Cambodian culture and tradition have had a rich varied history dating back many centuries. Over the years, the people of Cambodia developed a set of unique tradition from the syncretism of indigenous Buddhism and Hinduism.</p>\r\n<p style="text-align: justify;">Cambodians have been raised to respect their culture and are very traditional in their way of life. Tourists will see the well mannered Cambodian expressing a friendly &ldquo;Chumreap Suor&rdquo; when they meet one.</p>\r\n<h4 style="text-align: justify;">Chumreap Suor</h4>\r\n<p style="text-align: justify;">Cambodians traditionally greet with a Sampeah, which involves pressing the palms together before the chest with a slight bow and greeting with a polite &lsquo;Chumreap Suor&rsquo;. Customarily, the higher the hands are held and the lower the bow, the more respect is conveyed. Except when meeting elderly people or government officials, between men, this custom has been partially replaced by the handshake. Women usually greet both men and women with the same traditional greeting. Although it may be considered acceptable for foreigners to shake hands with a Cambodian, it is more appropriate to respect the custom and respond with a &lsquo;Chumreap Suor&rsquo;.&nbsp;</p>\r\n<p style="text-align: justify;"><img src="http://visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1508750584.jpg" width="50%" height="50%" /></p>\r\n<h4 style="text-align: justify;">Traditional Dances</h4>\r\n<p style="text-align: justify;">There are many classical dance forms in Cambodia, of which a highly stylized art form was once confined mainly to the courts of the royal palace and performed mainly by females. Known formally in Khmer as Robam Apsara, the dancers of this classical form are often referred to as Apsara dancers.</p>\r\n<p style="text-align: justify;">This dance form was first introduced to foreign countries and best known during the 1960s as the Khmer Royal Ballet. The first royal ballerina was Princess Norodom Bopha Devi, a daughter of King Norodom Sihanouk.</p>\r\n<p style="text-align: justify;">The Apsara Dance is particularly inspired by the style from around more than a thousand Apsara carvings in the Angkor temple complex. As evidenced in part by these Apsaras (celestial dancers), dance has been part of the Khmer culture for more than a millennium.</p>\r\n<p style="text-align: justify;">A visit to Cambodia is only complete when one has attended at least one such traditional dance performance.</p>\r\n<h4 style="text-align: justify;">Apsara Dance</h4>\r\n<p style="text-align: justify;">"the Royal Ballet of Cambodia" - a Masterpiece of Oral and Intangible Heritage of Humanity Date of Proclamation: November 2003. The Royal Ballet of Cambodia or Apsara Dance is a highly stylized art form was once confined mainly to the courts of the royal palace and performed mainly by females for the purpose of entertainment as well as ceremonial propitiation. It is the dominant genre of dance theatre in Cambodia that features the classical dance style. The repertoire includes dances of tribute or invocation and the enactment of traditional stories.</p>\r\n<p style="text-align: justify;">The dancers of this classical form are often referred to as Apsara dancers. This dance form was first introduced to foreign countries and best known during the 1960s as the Khmer Royal Ballet. The first royal ballerina was Princess Norodom Bopha Devi, a daughter of King Norodom Sihanouk. The Apsara Dance is particularly inspired by te style from around more than a thousand Apsara carvings in the Angkor temple complex. As evidenced in part by these Apsaras (celesial dancers), dance has been part of the Khmer culture for more than a millennium. A visit to Cambodia is only complete when one has attended at least one such traditional dance performance.</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;<img src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_2_1498107857.jpg" alt="" width="50%" height="50%" /></p>\r\n<p style="text-align: justify;">&nbsp;<strong>Lkhoan Sbek Thom</strong></p>\r\n<p style="text-align: justify;"><strong>"The big shadow puppet"</strong> - a Masterpiece of Oral and Intangible Heritage of Humanity Date of Proclamation: November 2005.&nbsp;Sbek Thom &lt;&gt; is a form of play performance using puppets with the effect of shadow. The puppets are made of leather (usually cow-hide). The artisan uses a large white backdrop in front of a big fire (now, they use projector alternatively) to show the shadow of the puppets on. It seems like an animator on TV. There are two main genres of Khmer shadow theatre: Sbek Thom and Sbek Por. In 2005, the UNESCO officially recognized Sbek Thom as a Masterpiece of the Oral and Intangible Heritage of Humanity.</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;"><img src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_3_1498107857.jpg" alt="" width="50%" height="50%" /></p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<h4 style="text-align: justify;">Lkhoan Khoal</h4>\r\n<p style="text-align: justify;">Lkhoan Khoal is another form of the Khmer dance which performed by males wearing masks, featuring enactment of the RAMAYANA (Reamker). The choreography is styled similarly to the Royal Ballet of Cambodia although not as refined and is performed along to Narrators and a Pinpeat ensemble.</p>\r\n<p style="text-align: justify;">&nbsp;<img src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1498556557.jpg" alt="" width="50%" height="50%" /></p>\r\n<p style="text-align: justify;">&nbsp;<strong>Kbach Kun Khmer Boran ( Martial Art )</strong></p>\r\n<p style="text-align: justify;">Khmer martial arts date back more than a thousand years, as evidenced by carvings and bas-reliefs in the Angkor temples. The martial arts include Bokator, Pradal Serey, Baok Chambab, Kbach Kun Dambong V&egrave;ng, amongst others.</p>\r\n<h4 style="text-align: justify;">Bokator</h4>\r\n<p style="text-align: justify;">Bokator, known formally as Labokatao, is a Cambodian martial art form that involves close hand-to-hand combat, ground techniques and weapons.</p>\r\n<p style="text-align: justify;">Bokator is one of the earliest Cambodian martial art and is said to be the close quarter combat system used by the armies during the Angkor era.</p>\r\n<p style="text-align: justify;">Practitioners are trained to strike with knees, elbows, hands, feet and even the head. Short sticks are commonly used as weapon.</p>\r\n<h4 style="text-align: justify;">Baok Chambab</h4>\r\n<p style="text-align: justify;">Baok Chambab is Khmer wrestling; a sport in which two opponents try to pin (hold) each other&rsquo;s back to the ground. A match consists of three rounds. Wrestlers perform pre-match ritual dancing. A wrestler wins a match by two out of three rounds. However, after each round, the loser is asked if he still wishes to continue with the match.</p>\r\n<p style="text-align: justify;">A Baok Chambab match is traditional accompanied by drum beats; two drums known as Skor Nhy and Chhmol, (female drum and male drum).</p>\r\n<p style="text-align: justify;">Traditional matches are held at the Cambodian National Olympic Stadium during the Khmer New Year and other Cambodian holidays.</p>\r\n<h4 style="text-align: justify;">Kbach Kun Dambong V&egrave;ng</h4>\r\n<p style="text-align: justify;">Kbach Kun Dambong V&egrave;ng literally refers to an ancient Cambodian martial art form involving the use of a long staff.</p>\r\n<p style="text-align: justify;">It has traditionally been practiced to prepare against enemies bearing eventual malice towards their villages and their country.</p>\r\n<p style="text-align: justify;">Now, it is particularly popular with youths in main sports clubs in Cambodia.</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;"><img src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1498561284.jpg" alt="" width="50%" height="50%" /></p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<h4 style="text-align: justify;">Pradal Serey</h4>\r\n<p style="text-align: justify;">Pradal Serey is traditional Khmer kick boxing. A match consists of five rounds and takes place in a boxing ring. There is a one or two-minute break in between each round. Before a match, boxers perform the praying rituals known as the Kun Krou. Traditional Cambodian music is played during a match. The instruments used are the Skor Yaul (a drum), the Sralai (a flute-like instrument) and the stringed Chhing. Boxers are required to wear leather gloves and shorts.</p>\r\n<p style="text-align: justify;">Victory is instantaneously granted when a boxer delivers a knockout which is determined when the knocked down boxer is unable to continue the fight after a 10-second count by the referee. Victory is also determined at the end of the match when judges decide by a point system which fighter was more effective. If the fighters end up with the same score, a draw is called.</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;"><img src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1498634283.jpg" alt="" width="50%" height="50%" /></p>\r\n<p style="text-align: justify;"><strong>Khmer Wedding</strong></p>\r\n<p style="text-align: justify;">Traditional Cambodian weddings are intricate affairs that consist of multiple ceremonies lasting three days and three nights. The wedding begins with the groom and his family traveling to the bride&rsquo;s home bearing gifts to the bride&rsquo;s family as dowry. Family members and friends are introduced, and wedding rings exchanged. Customarily, three traditional songs accompany this first segment; the first song announcing the arrival of the groom and the next is on the presentation of the dowry followed by a final song to invite the elders to chew Betel Nut, an age-old Khmer tradition. Then it is the Tea Ceremony, at which the bride and groom offer tea to the spirits of their ancestors.</p>\r\n<p style="text-align: justify;">To prepare the bride and groom for their life as a married couple, their hair must then be symbolically cut to represent a fresh start to their new relationship together as husband and wife. The master of ceremony performs the first symbolic hair cut; the bride and groom&rsquo;s parents, relatives, and friends then take turn to symbolically cut the bride and groom&rsquo;s hair and give them blessing and good wishes.</p>\r\n<p style="text-align: justify;">The finale is the most memorable segment of the wedding. Family members and friends take turns to tie the bride&rsquo;s and groom&rsquo;s left and right wrists with &lsquo;blessing strings&rsquo;. The praises and wishes of happiness, good health, success, prosperity, and long-lasting love are acknowledged and witnessed by the loud sound of the gong and joyful cheers. Then, they throw palm flowers over the new couple accompanied by a traditional song. After the couple is pronounced husband and wife, the groom holds the bride&rsquo;s fabric into the bridal room accompanied by a traditional song.</p>\r\n<p style="text-align: justify;">At the close of this wedding ceremony, all of the guests are invited to a wedding reception accompanied by an orchestral concert. The Khmer wedding is a rowdy and joyous event.</p>\r\n<p style="text-align: justify;">Nowadays most families reduce the three-day and three-night ritual to a one-day affair.</p>\r\n<p style="text-align: justify;"><img src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1498634983.jpg" alt="" width="50%" height="50%" /></p>\r\n<h4 style="text-align: justify;">Traditional Medicine</h4>\r\n<p style="text-align: justify;">The Khmer traditional medicine is a form of naturopathy using natural remedies, such as roots, barks, leaves and herbs to motivate the body&rsquo;s vital ability to heal and maintain itself. It has been used to treat various diseases for many years. The ancient Khmer people first formulated this medical lore during the Angkor period. It offers a holistic approach avoiding the use of surgery and drugs. Practitioners of this therapy are known locally as Krou Khmer.</p>\r\n<p style="text-align: justify;">Khmer traditional doctors are receiving recognition and training from the government at the National Center of Traditional Medicine. Medical books in Pali text have been gathered from all the pagodas throughout the country; collated and interpreted into the Khmer language at the center. The center welcomes traditional healers from across the kingdom to share knowledge and train healers to a uniform level and to assimilate their localized knowledge.</p>\r\n<p style="text-align: justify;"><img src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1498638851.jpg" alt="" width="50%" height="50%" /></p>\r\n<p style="text-align: justify;">&nbsp;</p>', '[{"filename":"add_attachment_0_1490341024.jpg","des":""},{"filename":"add_attachment_0_1498107857.jpg","des":""},{"filename":"add_attachment_2_1498107857.jpg","des":""},{"filename":"add_attachment_3_1498107857.jpg","des":""},{"filename":"add_attachment_0_1498556557.jpg","des":""},{"filename":"add_attachment_0_1498557094.jpg","des":""},{"filename":"add_attachment_0_1498561284.jpg","des":""},{"filename":"add_attachment_0_1498634283.jpg","des":""},{"filename":"add_attachment_0_1498634983.jpg","des":""},{"filename":"add_attachment_0_1498638851.jpg","des":""},{"filename":"add_attachment_0_1508750584.jpg","des":""}]', '2017-03-24 14:37:04', 1, '2018-01-15 11:47:42', 5, 735, 1),
(68, 6, '12000', 'Phnom Penh', '<p><strong>PHNOM PENH</strong></p>\r\n<p>Phnom Penh was founded by a rich old lady named Penh, who built up a sanctuary on the hill called &ldquo; Wat Phnom Daun Penh&rdquo;(old Lady Penh&rsquo;s Pagoda).In 1432,King Ponhea Yat moved the capital from Bassac City (in the ancient Kampong Cham Province)to Phnom Daun Penh. The Sanctuary was removed, and it was replace by the King. Then he built up the hill and constructed a brick stupa on top.</p>\r\n<p>After the inauguration, the King named the hill &ldquo;Preah Chetdei Paravata&rdquo;, but nowadays it is simply called Wat Phnom. Actually, the first establishment did not last long, the capital moved from one place to another. Until 1866, in the reign of King Norodom, the capital moved to Phnom Daun Penh again and remains up to the Present time, Phnom Penh is the sixth capital after Nokor Phnom, Angkor Wat, Longvek,Srei Santhor,and Udong.</p>\r\n<p>Phnom Penh, a capital of Cambodia covering an area of 290 square kilometers, offers visitors plenty of opportunity for a city tour, shopping and dinner. It is home to the Royal Palace, National Museum and Wat Phnom, and it is the commercial, political, cultural and tourism hub. Phnom Penh received the world leadership award Number One for Urban Renewal Planning for a Population Boom.</p>\r\n<p>Particularly, valuable products that can be found here include seafood, freshwater food, fresh fruit, traditional handicrafts, and artistic articles.</p>\r\n<p>&nbsp;<img src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1499154976.jpg" alt="" width="50%" height="50%" /></p>\r\n<p><img style="float: right; margin: 0px 0px 10px 10px;" src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_1_1499154976.jpg" alt="" width="50%" height="50%" /></p>', '[{"filename":"add_attachment_0_1499154976.jpg","des":""},{"filename":"add_attachment_1_1499154976.jpg","des":""}]', '2017-07-04 14:56:15', 5, '2017-07-04 17:07:08', 5, 218, 1),
(69, 6, '2201', 'Oddor Meanchey', '<p><strong>Anlong Veng Historical Tourism Site</strong></p>\r\n<p>Anlong Veng is a district amid five district of Oddar Meanchey province and it is located along the road 68, about 80km in the east the Oddar Meanchey provincial town, it borders Trapeang Prasat district to the east, Samraong city to the west, VA Rin district and Sre Snam district to the south (Siem Reap province) and Thailand to the north. There are 5 communes and 57 villages. Anlong Veng area is a house once owned by former Khmer Rouge Commander Ta Mok, from 1979 until late 1997, this area was organized and controlled by the Khmer Touge&rsquo;s armies.</p>\r\n<p>There are more evidences. The surviving today to preserve and development Anlong Veng historic tourist for attracting visitors to the lives of citizens today.</p>\r\n<p>Understand visit leader&rsquo;s houses of Khmer Rouge and some remain evidences in included Pol Pot&rsquo;s radio broadcast and Ta Mok&rsquo;s forge (iron cage) and other remain proofs. The Royal government has discussed on turning this area into a historical site to attract even more tourists. This tourism area is being executed by Ministry of Tourism.</p>\r\n<p>-Anlong Veng district was officially organized in 1999, Royal government issued sub degree 17, March 1999.</p>\r\n<p>-Anlong Veng became historical tourism site that put sub degree 23, March 2010 containing 14 sites:</p>', '[]', '2017-07-11 16:25:34', 5, '2018-01-19 15:15:56', 5, 59, 0),
(70, 6, 'Kratie_Province', 'KRATIE PROVINCE ', '<p><strong>Kratie Province</strong></p>\r\n<p>Kratie (pronounced Kror-ches) is a relatively quiet town that is located on the east bank of the Mekong River. It is approx. 315 km from the city of Phnom Penh and famous for his resident Irrawaddy dolphins to make a very popular destination. This is a very beautiful town with plenty of big islands and sandbars. There are plenty of attractive homes throughout the town that have French and Khmer architecture, with many of the older buildings relatively unscathed from the war years, a great reason to explore this pleasant town is ability to view the local freshwater Irrawaddy dolphin population. This is only possible in this one town across the entire country of Cambodia.</p>\r\n<p>It is easy to see the dolphins by taking a 25minutes boat ride that also makes it possible to admire the authentic life of the local Cambodians. This boat ride can also include visiting a temple in the mountains and the rapids upstream. The town of Kratie has a vibrant market scene that makes it possible to take in the rural Cambodia life and sample some of the local delicacies (Such as the grilled corn cakes).In addition, this town is conveniently placed about midway between Phnom Penh and Rattanakiri. Whether it is staying in town for several days or overnight, this is a great layover for those planning to visit Laos on the Cambodia package tours, or simply visiting to see the prime attraction in Kratie: fresh water dolphins.</p>\r\n<p><iframe src="https://www.youtube.com/embed/3O9y8SeoqAQ?ecver=1" width="560" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe></p>', '[{"filename":"add_attachment_0_1499941183.jpg","des":""},{"filename":"add_attachment_1_1499941183.jpg","des":""},{"filename":"add_attachment_2_1499941183.jpg","des":""},{"filename":"add_attachment_3_1499941184.jpg","des":""},{"filename":"add_attachment_4_1499941184.jpg","des":""}]', '2017-07-13 11:28:26', 5, '2017-08-03 17:43:56', 5, 320, 1),
(71, 6, 'Stung_Treng_', 'STUNG TRENG PROVINCE', '<p><strong>Stung Treng Province</strong></p>\r\n<p>Stung Treng Province is a beautiful place located on a high sandy bank overlooking Mekong River where it is join by the Sekong River. It is about 455 km North of Phnom Penh and 40 km south of the Laos border. This charming town is link to Banlung (Rattanakiri) and serves more than just a stopover. It is an important trading hub between Cambodia and Laos, Sekong Bridge Provides a convenient gateway from the border of Laos.</p>\r\n<p>For Tourists, the amazing Sopheakmith Waterfall here never ceases to mesmerize visitors the stretch of the mighty Mekong is also another great place for observing the very rare Irrawaddy dolphins, these illusive Mekong dolphins are often seen along this stretch of the river.</p>\r\n<p>Also and other great place for observing the very rare Irrawaddy dolphins. These illusive Mekong dolphins are often seen along this stretch of the river. Seam Pang, with its verdant and lush tropical forests, is one of the best nature conservation regions in the country. However, this remote wildlife area is only accessible by boat from Strung Treng town about 80km away.</p>\r\n<p>The Virak Chey National Park is home to hundreds of bird species, many of which are endangered, December through March are the best months to visit this highland bird sanctuary when many of the lowland ponds inside the area and Virak Chey National Park have sort of dried up and most of the birds fly along the upper Sekong River.</p>', '[{"filename":"add_attachment_0_1499943530.jpg","des":""}]', '2017-07-13 11:41:26', 5, '2017-07-13 17:58:50', 5, 208, 1),
(72, 6, '85572', 'Kratie Province', '<p>Kratie (pronounced Kror-ches) is a relatively quiet town that is located on the east bank of the Mekong River. It is approx. 315 km from the city of Phnom Penh and famous for his resident Irrawaddy dolphins to make a very popular destination. This is a very beautiful town with plenty of big islands and sandbars. There are plenty of attractive homes throughout the town that have French and Khmer architecture, with many of the older buildings relatively unscathed from the war years, a great reason to explore this pleasant town is ability to view the local freshwater Irrawaddy dolphin population. This is only possible in this one town across the entire country of Cambodia.</p>\r\n<p>It is easy to see the dolphins by taking a 25minutes boat ride that also makes it possible to admire the authentic life of the local Cambodians. This boat ride can also include visiting a temple in the mountains and the rapids upstream. The town of Kratie has a vibrant market scene that makes it possible to take in the rural Cambodia life and sample some of the local delicacies (Such as the grilled corn cakes).In addition, this town is conveniently placed about midway between Phnom Penh and Rattanakiri. Whether it is staying in town for several days or overnight, this is a great layover for those planning to visit Laos on the Cambodia package tours, or simply visiting to see the prime attraction in Kratie: fresh water dolphins.</p>', '[{"filename":"","des":""}]', '2017-07-13 15:50:37', 5, '2017-07-13 16:06:36', 5, 0, 0),
(73, 6, 'eererre', 'my province', '<p>my provincemy provincemy provincemy province</p>', '[{"filename":"","des":""}]', '2017-07-13 15:58:47', 1, '2017-07-13 16:03:19', 1, 0, 0),
(74, 6, '73', 'MONDOLKIRI PROVINCE', '<p><strong>Mondolkiri Province </strong></p>\r\n<p>Mondolkiri joins the frontier province of Rattanakiri in the northeastern extreme of Cambodia, about 543km from Phnom Penh.</p>\r\n<p>Despite being the largest in land area, this is the most sparsely populated province in the country&lsquo;&lsquo;Mondulkiri&lsquo;&lsquo;mean &ldquo;Meeting of the Hills&rdquo;. The average elevation is 800 meters and the weather is cooler than most elsewhere. The provincial capital, Sen Monrom, has been called &ldquo;Switzerland of Cambodia&rdquo; and serves as a perfect base for exploring this fascinating territory. The land is very rich in natural resources especially hard minerals such as gold and gems which can be found in all five districts of the province.</p>\r\n<p>Known also for its forested hills and beautiful waterfalls, Mondulkiri is one of the most popular destinations for Eco-tourism in Cambodia, Only about 20 percent of the population is collectively made up of Khmer, Chinese and Muslims. More than 80 percent of the people here are the tribal minorities, the majority of which being from the Phnong tribe which is famous for their gongs and antique jars, These jars and gongs are among the most valuable possessions of indigenous communities both in traditional and spiritual as well as material terms, Tourists are invited to participate in a wine sipping tradition which dates back since the first visitors from the outside world visited the tribes many years ago and the wine is traditionally brewed from rice and stored in these precious jars which are more than a thousand years old.</p>\r\n<p>Get further off the beaten tracks and explore the northeastern frontier jungle safely on the back of an elephant trekking through lust unspoilt tropical rain forest where various wild mammals, including d holes, bears, wild cattle, buffaloes, deers, elephants, gaurs, gibbons, goats, horses, leopards, monkeys, otters, rabbits, tigers and wolves roam.</p>\r\n<p>This kind of trekking creates jobs for local people and supports eco-tourism and a greener mode of transportation.</p>\r\n<p>&nbsp;</p>\r\n<p><img src="http://visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1500606036.jpg" alt="" width="50%" height="50%" /></p>\r\n<p>&nbsp;</p>\r\n<p><img src="http://visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1500369782.jpg" alt="" width="50%" height="50%" /></p>\r\n<p><img src="http://visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1500605634.jpg" alt="" width="50%" height="50%" /></p>\r\n<p>&nbsp;</p>', '[{"filename":"add_attachment_0_1500369782.jpg","des":""},{"filename":"add_attachment_0_1500605634.jpg","des":""},{"filename":"add_attachment_0_1500606036.jpg","des":""},{"filename":"add_attachment_0_1500607017.jpg","des":""}]', '2017-07-14 15:31:49', 5, '2017-08-07 16:49:27', 1, 247, 1),
(75, 6, '75', 'RATTANAKIRI', '<p><strong>Rattanakiri Province</strong></p>\r\n<p>Rattanakiri Province is populate and known for being chock-full of biodiversity, having always been occupied by many separate highland Khmer Loeu hill tribes, some of which have little contact with the rest of the word and still maintaining much of their own traditions. They each have their own language and ways of interpreting life, the universe and everything.</p>\r\n<p>Located at the northeastern corner of Cambodia, this intriguing frontier province is bordered by Laos across the mountains of the Anna mite Range through a hilly plateau between the Se San River and Srepok River to the north with Vietnam to the east.</p>\r\n<p>This frontier province is renowned for her unique natural beauty and wealth of natural resources. The undulating hills and mountains, plateaus, watershed lowlands, clear crater takes, rivers and beautiful waterfall form an impressive itinerary of intriguing destinations for eco-tourism.</p>\r\n<p>Today, although rapid development in the province has altered some traditional ways of life, this remains a very interesting destination for the adventurous and eco-tourism explorers.</p>\r\n<p>&nbsp;</p>', '[{"filename":"add_attachment_0_1500697269.jpg","des":""},{"filename":"add_attachment_1_1500697270.jpg","des":""}]', '2017-07-14 15:33:59', 5, '2017-07-22 11:21:09', 5, 205, 1),
(76, 6, 'Kep_province', 'Kep province', '<p>This is relaxing seaside province situated 168 Km away from Phnom penh . Besides the beaches, Kep is best known for having the best seafood , especially crabs. This coastal province is one of the ''must Visit'' when in Cambodia.</p>\r\n<p>Several islands, including the popular Rabbit Island (Koh Thonsay),lay just a short boat ride off its coast.</p>\r\n<p>Freshly caught crabs are sorted according to size and usually sold even before they are brought to shore. A small section of the beach doubles as a regular crab-trading depot and this busy crab market on the water''s edge has become a popular tourist itinerary .</p>\r\n<p>There are vendors who will prepare crab dishes in any which way one prefers and serve the m by beach. Crabs fried with pepper is a local specialty dish. &nbsp;</p>', '[{"filename":"add_attachment_0_1502094149.jpg","des":""}]', '2017-07-14 15:50:18', 5, '2017-10-25 15:36:52', 1, 215, 1),
(77, 6, 'RattanakiriProvince', 'Rattanakiri Province', '<p>Rattanakiri Province is located 636 km northeast of Phnom Penh. Banlung is the proinceal town of Rattanakiri . It can be reached by air and car. Tourists are enthralled by many pictjuresque sighs in &nbsp;the remote primitive province.</p>', '[{"filename":"","des":""}]', '2017-07-22 11:05:18', 5, '2017-07-22 11:09:01', 5, 1, 0),
(78, 6, '18000', 'PREAH SIHANOUK PROVINCE', '<p>PREAH SIHANOUK PROVINCE</p>\r\n<p>Named after the late King Norodom Sihanouk, the beloved monarch who is the father of the present king , Preah Sihanouk Province, is about 230 kilometer from Phnom Penh. Known dearly as Sihanoukville in the region, this has become one of the best seaside destinations in Southeast Asia.</p>\r\n<p>The province boasts fabulous sea-food , pristine beaches and water-sports. There are many islands off the coast that are easily accessed by boat. Popular Beaches include the Deum Chery, Serendipity Beach, Independence Beach, Sokha beach ,Otres Beach, Victoria Beach, Ream&nbsp; Beach,Prek&nbsp; Treng and the very popular Ochheuteal Beach.</p>', '[{"filename":"","des":""}]', '2017-08-04 15:31:47', 5, '2017-08-04 15:42:01', 5, 0, 0);
