(79, 6, '2401', 'Pailin Province', '<p style="text-align: justify;"><a title="Pailin Province" href="http://pailin.tourismcambodia.org/" target="_blank" rel="noopener">Pailin</a> is a province on the northern edge of the Cardamom Mountains in western Cambodia, 25km from the border of Thailand. This province is surrounded by <a title="Battambang Province" href="http://battambang.tourismcambodia.org/" target="_blank" rel="noopener">Battambang province</a>, and was officially carved out of <a title="Battambang Province" href="http://www.battambang.info/" target="_blank" rel="noopener">Battambang</a> to become a separate administrative division after the surrender of the Khmer Rouge in 1996. A handful of natural attractions are await in <a title="Pailin Province" href="http://pailin.tourismcambodia.org/" target="_blank" rel="noopener">Pailin</a>, including scenic mountains, waterfalls, and a lush bamboo forest. Its capital is <a href="http://pailin.tourismcambodia.org/">Pailin </a>City.</p>\r\n<p style="text-align: justify;">Another interesting sites for tourists is Wat Rattanak Sorphon, a Burmese style pagoda that is more than 570 years old. With beautiful Burmese characters are inscribed on the gates,&nbsp;this pagoda is evidence of early Burmese settlement in this area. Indeed, the Burmese were the first people to discover the precious gems in the region, and <a title="Pailin Province" href="http://pailin.tourismcambodia.org/" target="_blank" rel="noopener">Pailin</a> subsequently became the largest mining center for sapphires and rubies in Indochina. <a title="Phnom Yat | Pailin Province" href="http://www.pailin.info/information/index.php?view=attdetail&amp;prv=14&amp;att=176&amp;" target="_blank" rel="noopener">Phnom Yat</a> has a good number of places where visitors can still see the gem-mining activities today.</p>\r\n<p><strong>Pailin Economy, Cambodia</strong></p>\r\n<p>The surrounding area of Pailin City was rich in a variety of gemstones which were mined almost clean to support the Khmer Rouge. They also logged the area to create personal wealth with no regard for the effect on the environment. Nowadays all you can find is low-quality, cheap, hand-faceted gemstones at the market in Pailin downtown.</p>\r\n<p>&nbsp;After the exploitation of the natural resources available, the Khmer Rouge invested their money in the Casinos around Pailin. Pailin is located in the most heavily mined area in the world, so especially unaware travelers are cautioned to stay only on marked roads.</p>\r\n<p>Citizens of Pailin will accept Baht, Riels and US dollars, though US dollars are preferred.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Pailin Climate, Cambodia</strong></p>\r\n<p>The country has a tropical climate - warm and humid. In the monsoon season, abundant rain allows for the cultivation of a wide variety of crops. This year-round tropical climate makes Cambodia ideal for developing tourism. Travelers need not to fear natural disasters such as erupting volcanoes or earthquakes, and the country is not directly affected by tropical storms.</p>\r\n<p><strong>Climate</strong>: Cambodia can be visited throughout the year. However, those plans to travel extensively by road should be avoided the last two months of the rainy season when some countryside roads may be impassable. The average temperature is about 27 degrees Celsius; the minimum temperature is about 16 degrees. December and January are the coolest months, whereas the hottest is April.</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>', '[]', '2017-08-31 16:39:11', 5, '2018-01-19 15:17:46', 5, 34, 0),
(80, 6, '0903', 'Koh Kong Province', '<p>Located at the southwestern tip of the country near the mouth of the Kah Bpow River in Smach Mean Chey district on the Gulf of Thailand, the city is only 10 kilometers from the Thai border. From here , tourists now have access to the border of Thailand by a newly constructed bridge reputed to be the longest in Cambodia. The 1900 meter long Thai-Cambodian border-bridge was completed at a cost of US$7.2 million dollars. With the bridge and the upgrading of the road to the national highway plus the building of several casinos near the border, the town has developed into a more popular tourist destination. Besides the casinos, there is zoo and many pristine islands, mountains, jungles, rivers, waterfalls and mangrove forest which offer the tourist tons in terms of eco-tourism.</p>\r\n<p>The Peam krasop Mangroves are Asia''s largest and Koh Kong beaches are reputed to be one of the best beaches in Southeast Asia.</p>', '[{"filename":"","des":""}]', '2017-10-26 17:07:05', 5, NULL, NULL, 146, 1),
(81, 6, '1801', 'Preah Sihanouk Province', '<p>Preah Sihanouk province name after king Norodom Sihanouk since its independence from France in 1953, is known locally as kompong som. Located 230&nbsp; kilometers southwest of the Capital Phnom Penh, the province has become one of the best seaside destinations in Asia to be explored. Known for its fabulous beaches, the province revolves around fresh seafood, water-sports, and its surrounding islands. The popular beaches that line the contour of the city from north to south are the Victory Beach, Deum Chrey Beach , Independence Beach, Sokha Beach, Serendipity Beach, Ochheuteal Beach, Samdech Hun Sen Beach, Hawaii Beach, Ream Beach, and the Otres Beach.</p>\r\n<p>Being a beach town, there are also many sea-based activities in Preah Sihfanouk for adventurous visitors. The list of excitements includes boating, island-hopping, fishing, diving, snorkeling in crystal clear waters and also people-watching. For the expert enthusiast who wants to explore the mysterious underwater world of coastal Cambodia, the province has PADI Dive Centers and qualified instructors who know just the right spots to take you.</p>\r\n<p>There are dozens of untouched islands off the coast of Preah Sihanouk. Koh Rong and Koh Rong Samlon both feature blissfully untrodden beaches with palm-shadded shorelines and these places offer lots of diving opportunities.</p>', '[{"filename":"","des":""}]', '2017-10-26 17:47:30', 5, '2017-10-27 17:27:09', 5, 149, 1),
(82, 2, 'eat_stay', '<span class="khmerNormal">ស្នាក់&បរិភោគ</span>', '<p>កន្លែងស្នាក់នៅ និងទទួលទានអាហារយ៉ាងមានឳជារសជាច្រើនត្រៀមខ្លូនរួចជាស្រេចសម្រាប់អ្នក។ ប្រញាប់រួសរាន់ក្នុងការកក់ទុកជាមុន ដើម្បីរីករាយការសម្រាកលំហែកាយដ៏ពិសេសរបស់អ្នក។</p>', '', '2018-12-06 16:03:45', 1, '2018-12-06 16:33:06', 1, 0, 1),
(83, 2, 'tourism_site', 'ទឹកដីទេសចរណ៍ដ៏ប្រណិត', '<p><span>ស្វែងយល់ពីអ្វីដែលល្អបំផុតនៃប្រទេសកម្ពុជាជាមួយនឹងដំណើរកម្សាន្តទេសចរណ៍ដែលមានលក្ខណៈជំនាញច្បាស់លាស់របស់យើងសម្រាប់ដំណើរកម្សាន្តតាមដេរដែលស្វែងយល់ពីវប្បធម៌ខ្មែរដ៏ល្អបំផុត។</span></p>', '', '2018-12-06 10:00:57', 1, '2018-12-06 10:34:59', 1, 0, 1);
