INSERT INTO `news` (`id`, `language_id`, `type`, `title`, `description`, `filename`, `data`, `user_id`, `datetime`, `lastUpdateDate`, `lastUpdateBy`, `view`, `subscription_sent`, `pinned`, `active`) VALUES
(1, 2, NULL, 'Welcome to Freightidea, The First Freight Online in Cambodia!', '<p>Freightidea.com&nbsp;is the Cambodia based, the first and original&nbsp;freight&nbsp;online&nbsp;that offer FREE&nbsp;QUOTATION, consulting and&nbsp;coaching about&nbsp;transportation. We will&nbsp;provide or share&nbsp;idea of freight to importers and exporters&nbsp;with powerful&nbsp;platform to trim the freight cost. To have the quotation for <a title="aifreight quotation" href="http://localhost/index.php?option=com_content&amp;view=article&amp;id=113&amp;Itemid=83&amp;lang=en">Airfreight</a>, <a title="FCL" href="http://localhost/index.php?option=com_content&amp;view=article&amp;id=116&amp;Itemid=87&amp;lang=en">Seafreight FCL</a>, <a title="LCL" href="http://localhost/index.php?option=com_content&amp;view=article&amp;id=115&amp;Itemid=86&amp;lang=en">Seafreight LCL</a> and <a title="Trucking" href="http://localhost/index.php?option=com_content&amp;view=article&amp;id=114&amp;Itemid=85&amp;lang=en">Trucking</a>, just click on the link&nbsp;and fill in the details that''s all.</p>\r\n<p>Freightidea&nbsp;also created a freight directory for&nbsp;all transportation companies including freight forwarders, trucking companies, shipping lines and&nbsp;airlines to list in their company profile. This&nbsp;can help customers to find the freight&nbsp;providers more easier. Search for your company profile first and if you cannot find one, please send us your&nbsp;company profile so that our team can update for you. It is FREE of charge.</p>', '[{"filename":"add_attachment_0_1471714354.zip","des":""}]', NULL, 1, '2016-08-13 00:00:00', '2016-08-21 00:32:34', 1, 13, 1, 0, 1),
(2, 2, NULL, 'testfa fd adadfdsf a', 'fdsafds', NULL, NULL, NULL, NULL, '2016-08-16 13:09:12', 1, 1, 0, 0, 0);
