(1, 285, '298', 'Cambodiana Hotel', '<p>A warm welcome to the Kingdom of Cambodia. Situated on the banks of the famous Mekong River, the magnificent Hotel Cambodiana is located in the heart of Phnom Penh&rsquo;s central business and tourist districts, offering visitors convenient access to all that Phnom Penh has to offer.</p>\r\n<p>Hotel Cambodiana exudes an atmosphere of understated elegance, balancing a sense of traditional Khmer culture with everything that is possible in a contemporary world of the finest hospitality.</p>\r\n<h4 class="title">Our History</h4>\r\n<p><img src="http://hotelcambodiana.com.kh/wp-content/uploads/2016/08/About-us-page-our-history.jpg" alt="" width="100%" /></p>\r\n<p>During the mid-1960s, King Sihanouk initiated the Hotel project by approaching renowned Architect of the time; Lu Ban Hap, during what was better known as the era of &lsquo;New Khmer Architecture&rsquo;. After several years of design and research, today&rsquo;s iconic Hotel Cambodiana was inaugurated in late 1969.</p>\r\n<p>Built on reclaimed land next to a casino, the then 100-room hotel was erected on columns to maximise sweeping views of the river. Sadly, the glory of the hotel and casino were short lived as civil war and the Khmer Rouge devastated the Kingdom. In 1970, Lon Nol&rsquo;s troops overthrew King Sihanouk and began using the hotel as military barracks, followed by many years of occupation under the Khmer Rouge. When peace was finally restored to Cambodia in the early 1990s, luxury hotel and resort chain, the Sofitel, acquired the prestigious property.</p>\r\n<p>In the mid-2000&prime;s, Cambodian owned the &lsquo;Royal Group of Companies&rsquo; purchased the property and has continued to invest to restore the Hotel to its former glory while maintaining the integrity and cultural identity of this iconic landmark.</p>', '<p>Set along the Mekong River, this upscale, pagoda-style hotel is 1 km from the ornate Royal Palace and 14 km from the Killing Fields.</p>', '<ul style="list-style-type: square;">\r\n<li>Tel:&nbsp;855-23 426 288</li>\r\n<li>Concierge Service:&nbsp;855-23 426 288 (Ext. 140)</li>\r\n<li>Fax:&nbsp;855-23 426 392</li>\r\n<li>General Enquiries:&nbsp;info@hotelcambodiana.com.kh</li>\r\n<li>Reservations:&nbsp;reservation@hotelcambodiana.com.kh</li>\r\n<li>Physique Club:&nbsp;physique@hotelcambodiana.com.kh</li>\r\n<li>Guest Relations:&nbsp;fom@hotelcambodiana.com.kh</li>\r\n</ul>', '11.55959535364442,104.93628859519958,17', 1, '313 Sisowath Quay, Phnom Penh, Kingdom of Cambodia', '[{"filename":"add_attachment_2_1490323898.jpg","des":""},{"filename":"add_attachment_3_1490323898.jpg","des":""},{"filename":"add_attachment_4_1490323898.jpg","des":""},{"filename":"add_attachment_5_1490323899.jpg","des":""},{"filename":"add_attachment_6_1490323899.jpg","des":""},{"filename":"add_attachment_7_1490323899.jpg","des":""},{"filename":"add_attachment_8_1490323899.jpg","des":""},{"filename":"add_attachment_0_1490326194.jpg","des":""}]', 58, 0, '50.00', '2000.00', NULL, NULL, '2017-03-24 09:51:37', 1, '2018-12-27 15:52:51', 1, 1, 1, '2017-05-18 00:00:00', 1, 1),
(2, 285, '298', 'PHNOM PENH HOTEL', '<p><strong>Business Center </strong><br /><img style="float: right; margin: 0px 0px 10px 10px;" src="http://visitcambodia.localhost/upload/post_attachment/resized/add_attachment_0_1490324818.jpg" alt="" width="50%" />For all your office, news and information needs even while on holiday. The Phnom Penh Hotel Business Center is open 24 hours to provide internet access, letter writing, message sending and together with 10 persons meeting room capabilities. Our Hotel understands that even while on vacation, guests need to stay in touch with their business interests to stay ahead of the busy world.</p>\r\n<p><strong>Phnom Penh Souvenir Shop</strong><br />A visit to Cambodia is made perfect by the selection from many of the precious and artfully crafted silk and silver trinkets at the Phnom Penh Souvenir Shop. Here the artful heritage of Cambodian crafts are showcased with only the best and finest available.</p>\r\n<p><strong>Beauty Salon </strong><br />At Expression of Beauty, get pampered like a princess and attend to the grooming needs of your body as only Cambodian beauticians can do for you.<br />Get your hair refreshed from stress or highlighted in ways that can only help bring out your inner beauty.</p>\r\n<p>Professional Cambodian beauty care specialists are present to attend to details such as pedicures and manicures that travelers are often in need of after a hard day''s vacationing.</p>\r\n<p>Treat yourself to the finer needs of beauty and enliven your holiday even more by giving yourself a new refreshed look.</p>\r\n<p><strong>KTV Entertainment</strong><br />The Golden Century Club Karaoke is the place to be for a night out with friends dancing and singing your favorite tunes with charming hostesses. The Golden Century Club has the latest sound system and selection of songs like no other. Talented &nbsp;Philippino Bands entertain nightly with a wide repertoire of music as well.For all your office, news and information needs even while on holiday. The Phnom Penh Hotel Business Center is open 24 hours to provide internet access, letter writing, message sending and together with 10 persons meeting room capabilities. Our Hotel understands that even while on vacation, guests need to stay in touch with their business interests to stay ahead of the busy world.</p>', '<p>For all your office, news and information needs even while on holiday. The Phnom Penh Hotel Business Center is open 24 hours to provide internet access, letter writing, message sending and together with 10 persons meeting room capabilities. Our Hotel understands that even while on vacation, guests need to stay in touch with their business interests to stay ahead of the busy world.</p>', '<p>Tel:&nbsp;&nbsp; &nbsp;+855 (0) 23 991 868<br />Fax: +855 (0) 23 991 818<br />E-mail: info@phnompenhhotel.com</p>', '11.57854644366704,104.91588234901428,15', 18, 'No. 53, Monivong Boulevard, Sangkat Srah Chok P.O. Box 1131, Phnom Penh Kingdom of Cambodia', '[{"filename":"add_attachment_0_1490324818.jpg","des":"PHNOM PENH HOTEL 1"},{"filename":"add_attachment_1_1490324819.jpg","des":"PHNOM PENH HOTEL 2"},{"filename":"add_attachment_2_1490324819.jpg","des":"PHNOM PENH HOTEL 3"},{"filename":"add_attachment_0_1490326106.jpg","des":"PHNOM PENH HOTEL 4"},{"filename":"add_attachment_1_1490326107.jpg","des":"PHNOM PENH HOTEL 5"},{"filename":"add_attachment_2_1490326107.jpg","des":"PHNOM PENH HOTEL 6"},{"filename":"add_attachment_3_1490326108.jpg","des":"PHNOM PENH HOTEL 7"}]', 68, 0, '50.00', '1500.00', NULL, NULL, '2017-03-24 10:06:58', 1, '2018-12-28 17:01:32', 1, 1, 1, '2018-12-28 17:01:28', 1, 1),
