(4, 285, '298', 'Angkor Century Resort & Spa', '<p>The birth of Angkor Century Resort and Spa was the brainchild of Cambodian businessmen. The blossomed lotus flower, being the flower which is used to appease the Gods in Cambodia is the cornerstone of the entire decoration of the hotel. Thus this beautiful floral theme is omnipresent in the hotel from all room numbers, decoration of the balustrades to the cornice.The birth of Angkor Century Resort and Spa was the brainchild of Cambodian businessmen. The blossomed lotus flower, being the flower which is used to appease the Gods in Cambodia is the cornerstone of the entire decoration of the hotel. Thus this beautiful floral theme is omnipresent in the hotel from all room numbers, decoration of the balustrades to the cornice.</p>', '', '<p>Tel: +855 (63) 963 777&nbsp;&nbsp;<br />Fax: + 855 (63) 963 789 <br />Executive Office: +855 (63) 963 123<br />Website&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; : <a href="http://www.angkorcentury.com/">www.angkorcentury.com<br /></a>General Email&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;: <a href="mailto:info@angkorcentury.com">info@angkorcentury.com</a></p>\r\n<p><strong>Reservations<br /></strong>Email: Reservation: <a href="mailto:resa@angkorcentury.com">resa@angkorcentury.com</a></p>\r\n<p><strong>Sales <br /></strong>Email: <a href="mailto:dos@angkorcentury.com">dos@angkorcentury.com</a></p>', '13.36515811153289,103.85672092437744,15', 17, 'Komay Road, Kum Svay Dangkom, Siem Reap, Kingdom of Cambodia', '[{"filename":"add_attachment_0_1496894471.jpg","des":""},{"filename":"add_attachment_1_1496894471.jpg","des":""},{"filename":"add_attachment_2_1496894473.jpg","des":""}]', 46, 0, '90.00', '270.00', NULL, NULL, '2017-06-08 11:01:11', 18, '2017-06-09 11:10:35', 1, 1, 0, NULL, 1, 1),
(5, 285, '298', 'Royal Angkor Resort', '<p>202 rooms, 120 Superiors, 78 Deluxe,&nbsp;</p>', '<p>Fine dinning Restuarant, Bar, Swimming Pool, and Spa</p>', '<p><a href="http://www.royalangkorresort.com">www.royalangkorresort.com</a>&nbsp;</p>', '13.379959114035275,103.82946968078613,15', 17, 'Highwat National Road No. 6, Phum Kasekam, Siem Reap', '[]', 20, 0, '58.00', '1500.00', NULL, NULL, '2017-06-08 11:18:12', 20, '2017-06-08 11:20:04', 20, 0, 5, '2018-02-19 10:11:55', 1, 1),
(6, 285, '298', 'Angkor Holiday Hotel', '<p>Welcome to luxury accommodation with international standard service and genuine Cambodia hospitality and smile. Our friendly, helpful staff will ensure that your stay with us is enjoyable and relaxing after a rich but sometimes tiring day at the Angkor Temples. The hotel offers 162 most comfortable rooms that are all equipped with an array of fratures intended for your comfort.</p>\r\n<p>Angkor Holiday Hotel conveniently &amp; perfectly situated at the heart of Siem Reap&rsquo;s Commercials &amp; Businesses district, Angkor Holiday Hotel offers tremendously convenient access to banks, healthcare, restaurants, bars, cafes, convenience stores and shops.</p>\r\n<p>At Angkor Holiday Hotel, we pride ourselves on service quality of a genuinely high level and on attending to our guest&rsquo;s every need with courteousness and warmth. The cuisine at the Pavilion Restaurant comes from around the world and is delicately prepared by our renowned chef who, with his team, can bring any dishes into the limelight and turn each meal into a fine dining experience.</p>\r\n<p>Both the world famous Angkor Wat &amp; Siem Reap International Airport is only 15 minutes drive and the Royal Palace is 2 minutes away.</p>\r\n<p><strong>If you are Booking now, You will get something free !!!</strong></p>\r\n<ul>\r\n<li><strong>20% off for all Rooms type</strong></li>\r\n</ul>\r\n<ul>\r\n<li><strong>30% off for Spa</strong></li>\r\n</ul>\r\n<ul>\r\n<li><strong>Free Pick-up</strong></li>\r\n</ul>', '<p>Angkor Holiday Hotel standing in Siem Reap central 1 km from Old market,200m from Royal recidece(Preah Ang Chek Preah Ang Chom )nearly trafict light to old market corner of sivutha blvd &amp; national road No. 6.From airport 15 mn by Tuk Tuk ,10 mn by car or van.</p>', '<p><strong><span style="font-size: 8.5pt; font-family: ''Verdana'',''sans-serif''; color: black;">ANGKOR HOLIDAY HOTEL</span></strong><span style="font-size: 8.5pt; font-family: ''Verdana'',''sans-serif''; color: black;">SIEM REAP - CAMBODIA&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\r\n<p style="font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;"><span style="font-size: 8.5pt; font-family: ''Verdana'',''sans-serif''; color: black;">H/P : (855) 96 44 56 896/77 77 20 44</span></p>\r\n<p style="font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;"><u><span style="font-size: 8.5pt; font-family: ''Verdana'',''sans-serif''; color: black;"><a href="mailto:e-commerce@angkorholidayhotel.com">e-commerce@angkorholidayhotel.com</a></span></u></p>\r\n<p style="font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;"><span style="font-size: 8.5pt; font-family: ''Verdana'',''sans-serif''; color: black;">Tel: (855-63) 966 777, ( 855-17) 626 298&nbsp; Fax: (855-63) 966 800&nbsp;&nbsp;&nbsp;</span></p>\r\n<p style="font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;"><span style="font-size: 8.5pt; font-family: ''Verdana'',''sans-serif''; color: black;"><a href="mailto:reservation@angkorholidayhotel.com">reservation@angkorholidayhotel.com</a>&nbsp;</span></p>\r\n<p style="font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;"><span style="font-size: 8.5pt; font-family: ''Verdana'',''sans-serif''; color: black;">Tel/Fax: (855-23) 218 969&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\r\n<p style="font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;"><span style="font-size: 8.5pt; font-family: ''Verdana'',''sans-serif''; color: black;"><a href="http://www.angkorholidayhotel.com/">www.angkorholidayhotel.com</a></span></p>', '13.362858094557838,103.85645806789398,18', 17, 'Corner of Sivutha Blvd & National Road No. 6,', '[{"filename":"add_attachment_0_1496903208.jpg","des":""},{"filename":"add_attachment_1_1496903209.jpg","des":""},{"filename":"add_attachment_2_1496903210.jpg","des":""},{"filename":"add_attachment_3_1496903212.jpg","des":""},{"filename":"add_attachment_4_1496903214.jpg","des":""}]', 45, 0, '50.00', '330.00', NULL, NULL, '2017-06-08 13:26:48', 21, NULL, NULL, 1, 0, NULL, 1, 1),
(7, 286, '303', 'Malis Restaurant', '<h2 class="ppb_title"><span class="ppb_title_first">Discover&nbsp;</span>OUR STORY</h2>\r\n<div class="ppb_subtitle">BRINGING CAMBODIAN CUISINE BACK TO LIFE</div>\r\n<p>When you dine at Malis Restaurant, not only do you get to savor delicious Cambodian cuisine, you also consume an important story. During the 1970&rsquo;s under the Khmer Rouge, many of Cambodia&rsquo;s traditional recipes that had been passed on for centuries were forgotten and vanished from the kitchen.<br />Malis was born in 2004 out of the desire and passion to restore Cambodian cuisine to its former glory and put Cambodia back on the map as a culinary destination. Renowned for its fresh seasonal produce, delicate flavours and generous hospitality Master Chef Luu Meng and his team, decided to revive Cambodian cuisine from the past, adapt it to the present and preserve it for the future.</p>', '<h2 class="ppb_title"><span class="ppb_title_first">Discover&nbsp;</span>OUR VENUE</h2>\r\n<div class="ppb_subtitle">AS WELL AS EXQUISITE CAMBODIAN CUISINE, MALIS RESTAURANT OFFERS A SOPHISTICATED AND ELEGANT SETTING</div>\r\n<p>Located in the heart of Phnom Penh, near the Independence Monument, guests can choose to dine in the outdoor courtyard or in air-conditioned comfort. The tables surround a beautiful tropical garden with flowering frangipanis and a trickling water feature beside a giant statue of Buddha, abiding by the principles of Feng Shui.<br />Malis Restaurant is open for breakfast, lunch and dinner, and offers private dining rooms for business lunches or special events.</p>', '<p>Address: No. 136 Norodom Blvd, <br />Phnom Penh, Cambodia</p>\r\n<p>Tel:&nbsp;<a href="tel:+85516814888">+855 (0)15 814 888</a></p>\r\n<p>Email:&nbsp;<a href="mailto:phnompenh@malis-restaurant.com">phnompenh@malis-restaurant.com</a></p>\r\n<p>Website: <a href="http://www.malis-restaurant.com">www.malis-restaurant.com</a>&nbsp;</p>', '11.55338034294364,104.92899628345185,18', 1, 'No. 136 Norodom Blvd , Phnom Penh, Cambodia', '[{"filename":"add_attachment_0_1490257770.jpg","des":""},{"filename":"add_attachment_1_1490257770.jpg","des":""},{"filename":"add_attachment_2_1490257771.jpg","des":""},{"filename":"add_attachment_3_1490257771.jpg","des":""},{"filename":"add_attachment_4_1490257771.jpg","des":""}]', 28, 0, '5.00', '100.00', NULL, NULL, '2017-03-23 15:29:30', 1, '2018-12-28 16:59:58', 1, 1, 1, '2017-05-18 00:00:00', 1, 1),
(8, 286, '303', 'ភោជនីយដ្ឋាន រំដេង', '<p>រសជាតិពិតនៃប្រទេសកម្ពុជា ព្រៃរំដេងប្រារព្ធរឿងល្អក្នុងជីវិត - គ្រួសារអាហារនិងប្រពៃណី។ Plating ឡើងរូបមន្តបែបប្រពៃណីពិតប្រាកដក្នុងការច្នៃប្រឌិតនៅកម្ពុជាម្ហូបម៉ឺនុយរបស់យើងនឹងត្រូវប្រាកដថាដើម្បីបំពេញរបស់អ្នកសម្រាប់ម្ហូបអាហារក្នុងតំបន់។</p>\r\n<p>ដែលបានកំណត់នៅក្នុងអគារសម័យអាណានិគមស្រស់ស្អាតដែលហ៊ុំព័ទ្ធដោយសួនច្បារនិងអាងហែលទឹកមួយខៀវស្រងាត់, ព្រៃរំដេងគឺជាកន្លែងល្អបំផុតដើម្បីរត់គេចខ្លួន។ រឿងដែលល្អបំផុតត្រូវបានរកឃើញនៅក្នុងទីកន្លែងដែលមិនរំពឹងទុកច្រើនបំផុត។ tucked ឆ្ងាយនៅលើផ្លូវលេខ 174 អ្នកនឹងរកឃើញភោជនីយដ្ឋានរបស់យើងនៅប្រទេសកម្ពុជាបណ្តុះបណ្តាព្រៃរំដេងរត់ដោយអតីតយុវជននៅតាមផ្លូវក្នុងពេលហ្វឹកហាត់។</p>\r\n<p>ដែលបានកំណត់នៅក្នុងអគារអាណានិគមស្រស់ស្អាត, ព្រៃរំដេងបម្រើពូជអស្ចារ្យនៃអាហាររាប់ចាប់ពីប្រទេសកម្ពុជាស្ទើរតែភ្លេចបានរូបមន្តពីបណ្តាខេត្តដើម្បីម្ហូបច្នៃប្រឌិតសហសម័យរបស់កម្ពុជា។ អនុញ្ញាតឱ្យខ្លួនឯងពេលខ្លះដើម្បីរីករាយជាមួយការអាងទឹកនិង WiFi ដោយឥតគិតថ្លៃ។ សសរស្តម្ភផងដែរថាអាចផ្តល់នូវម្ហូបអាហារសម្រាប់អាពាហ៍ពិពាហ៍មុខងារនិងគណបក្សនិងអាចជាម្ចាស់ផ្ទះព្រឹត្តិការណ៍សំរាប់រហូតដល់ 160 នាក់។ ម៉ឺនុយអាហារថ្ងៃត្រង់ពិសេសបង្កើតជារៀងរាល់ថ្ងៃ។</p>', '<p>ព្រៃរំដេងមានទីតាំងស្ថិតនៅលើផ្លូវលេខ 174 (ឧកញ៉ាកេត) ជាមួយនឹងចំនួនផ្ទះនៅក្នុងឃុំចំនួន 74 # ផ្សារថ្មី 3, ខណ្ឌដូនពេញ, រាជធានីភ្នំពេញ, ប្រទេសកម្ពុជា។</p>', '<p><strong>T</strong> +855 92 219 565<br /><strong>E</strong> <a href="mailto:contact@romdeng-restaurant.org?subject=TREE%20Alliance%20Website" target="_blank" rel="noopener">contact@romdeng-restaurant.org</a></p>', '11.564619672210602,104.92262005805969,16', 18, '#74 St 174, Phnom Penh, Cambodia', '[{"filename":"add_attachment_0_1490258492.jpg","des":""},{"filename":"add_attachment_1_1490258493.jpg","des":""},{"filename":"add_attachment_2_1490258493.jpg","des":""},{"filename":"add_attachment_3_1490258493.jpg","des":""},{"filename":"add_attachment_0_1490319855.jpg","des":""}]', 49, 0, '0.00', '0.00', NULL, NULL, '2017-03-23 15:41:32', 1, '2018-12-28 17:00:51', 1, 1, 1, '2018-12-28 17:00:47', 1, 1),
