(11, 286, '303', 'Por Cuisine', '<p>It is a rice to riches story for owner Por whose name proudly stands out on the shingle. In 1983 Por had a vision of owning a fine dining restaurant. He started by opening a humble kiosk serving his traditional noodle creations to the people of Siem Reap. His simple dish became an essential part of the community food chain, a taste that made his family well known and celebrated.</p>\r\n<p>Now 30 years later, the dream and the flavours have come to life. The family tradition continues but with a state of the art modern classic restaurant design and an exciting array of enticing flavours from both the East and the West.</p>\r\n<p>Por Cuisine also serves individual set lunches, dinners, many choices of Ala cart menu and personalized catering for big or small parties and can include DAILY traditional APSARA dance show 07.30PM to 08.30PM in the tropical fresh air and green garden landscape. The venue is popular with both locals and international visitors.</p>', '<p>It is about 20 minute from the airport by Car.&nbsp;</p>\r\n<p>5 minute walk to old market.</p>', '<p>Call: 012 356585 | 078 969997 | 063 967797</p>\r\n<p>Email: <a href="mailto:reserve@porcuisine.com">reserve@porcuisine.com</a></p>\r\n<p>Web: <a href="http://www.porcuisine.com">www.porcuisine.com</a></p>\r\n<p>Facebook: www.facebook.com/porcuisine</p>', '13.353590526280271,103.86684626340866,20', 17, '#298, st.22, Watbo Village, Salakamroeuk', '[]', 2, 0, '0.00', '0.00', NULL, NULL, '2017-06-08 11:14:18', 19, NULL, NULL, 0, 5, '2017-07-19 15:06:57', 1, 1),
