(15, 287, '308', 'SEA Festival', 'More than 500,000 visitors are expected to attend the annual Sea Festival in Preah Sihanouk province this December, leading to concerns by tourism officials about room availability for all of them.\r\n\r\nThe fifth iteration of the annual event, which moves between coastal cities, includes cultural and sporting events aimed at both local and international visitors, explained provincial tourism director Taing Sochet Krishna. However he said the high numbers of expected visitors for the three-day event between December 17 and 19, what is traditionally high-season in Sihanoukville, could potentially become an issue. \r\n\r\nHo Vandy, secretary-general of the National Tourism Alliance, told Khmer Times that the high number of visitors was due to more disposable income amongst Cambodia’s growing middle class. He called on provincial authorities to ensure prices remained affordable, and that litter was removed, in order to provide the best experience for visitors.\r\n\r\n“The authorities should provide a high-level security to all visitors, and tourism industry service providers should not hike the price of products to be higher than normal. The environment surrounding the event should be clean and rubbish bins must be deployed for the public,” Mr. Vandy said', 'Phnom Penh (FN), Oct 10 – The Sea Festival 2016 originally scheduled for 16-18 December 2016 in Sihanoukville has been moved to 23-25 December 2016, according to a press release issued today by the Inter-Ministerial Organizing Committee for the festival.', 'Sabah Tourism Office\r\nPhone: +6088-248 698/ 211 732\r\nVisit website', '10.591237,103.539734,12', 18, 'sihanoukville', '[{"filename":"Sea-Festival-Poster.jpg","des":"ថដសថ"}]', 6, 0, '0.00', '0.00', '2017-12-20', '2017-12-23', '2017-03-10 00:00:00', NULL, '2017-06-06 08:39:21', 1, 1, 1, '2017-05-18 00:00:00', 1, 0),
