(18, 287, '305', 'Women Right''s Day', '<p>More than 500,000 visitors are expected to attend the annual Sea Festival in Preah Sihanouk province this December, leading to concerns by tourism officials about room availability for all of them. The fifth iteration of the annual event, which moves between coastal cities, includes cultural and sporting events aimed at both local and international visitors, explained provincial tourism director Taing Sochet Krishna. However he said the high numbers of expected visitors for the three-day event between December 17 and 19, what is traditionally high-season in Sihanoukville, could potentially become an issue. Ho Vandy, secretary-general of the National Tourism Alliance, told Khmer Times that the high number of visitors was due to more disposable income amongst Cambodia&rsquo;s growing middle class. He called on provincial authorities to ensure prices remained affordable, and that litter was removed, in order to provide the best experience for visitors. &ldquo;The authorities should provide a high-level security to all visitors, and tourism industry service providers should not hike the price of products to be higher than normal. The environment surrounding the event should be clean and rubbish bins must be deployed for the public,&rdquo; Mr. Vandy said</p>', '<p>Phnom Penh (FN), Oct 10 &ndash; The Sea Festival 2016 originally scheduled for 16-18 December 2016 in Sihanoukville has been moved to 23-25 December 2016, according to a press release issued today by the Inter-Ministerial Organizing Committee for the festival.</p>', '<p>Sabah Tourism Office Phone: +6088-248 698/ 211 732 Visit website</p>', '10.627681992417653,103.48068248632808,12', 18, 'Phnom Penh', '[{"filename":"womenright.gif","des":"ថដសថ"},{"filename":"add_attachment_0_1490772515.jpg","des":""},{"filename":"add_attachment_1_1490772515.jpg","des":""},{"filename":"add_attachment_2_1490772515.jpg","des":""},{"filename":"add_attachment_3_1490772516.jpg","des":""}]', 43, 0, '0.00', '0.00', '2017-03-08', '2017-03-08', '2017-03-29 00:00:00', NULL, '2017-03-29 14:29:33', 1, 1, 1, '2017-05-18 00:00:00', 1, 1),
(19, 287, '305', 'Labour''s Day', '<p>Labor Day in the United States is a public holiday celebrated on the first Monday in September. It honors the American labor movement and the contributions that workers have made to the strength, prosperity, laws and well-being of the country. It is the Monday of the long weekend known as Labor Day Weekend and it is considered the unofficial end of summer. The holiday is also a federal holiday.</p>\r\n<p>Beginning in the late 19th century, as the trade union and labor movements grew, trade unionists proposed that a day be set aside to celebrate labor. "Labor Day" was promoted by the Central Labor Union and the Knights of Labor, which organized the first parade in New York City. In 1887, Oregon was the first state of the United States to make it an official public holiday. By the time it became an official federal holiday in 1894, thirty U.S. states officially celebrated Labor Day.[1]</p>\r\n<p>Canada''s Labour Day is also celebrated on the first Monday of September. More than 80 countries celebrate International Workers'' Day on May 1 &ndash; the ancient European holiday of May Day &ndash; and several countries have chosen their own dates for Labour Day.</p>', '<p>Canada''s Labour Day is also celebrated on the first Monday of September. More than 80 countries celebrate International Workers'' Day on May 1 &ndash; the ancient European holiday of May Day &ndash; and several countries have chosen their own dates for Labour Day.</p>', '', '11.575764211282948,104.92297902615974,14', 1, 'Phnom Penh', '[{"filename":"add_attachment_0_1490778415.jpg","des":"Labour''s Day 1"},{"filename":"add_attachment_1_1490778416.jpg","des":"Labour''s Day 2"},{"filename":"add_attachment_2_1490778416.jpg","des":"Labour''s Day 3"},{"filename":"add_attachment_3_1490778416.jpg","des":"Labour''s Day 4"},{"filename":"add_attachment_0_1490778814.jpeg","des":"test"}]', 96, 0, '0.00', '0.00', '2017-05-01', '2017-05-01', '2017-03-29 16:06:55', 1, '2017-04-19 16:37:11', 1, 1, 1, '2017-05-18 00:00:00', 1, 1),
(20, 287, '307', 'Visak Bochea', '<p>Born June 15 is the Day of Buddhists worldwide will celebrate an important Buddha.</p>\r\n<p>Another important thing is the United Nations announced on 15 December 1999 recognition of Vesak is an international festival that could held at the United Nations offices all over the world.</p>\r\n<p>Vesak festival beneficial for mankind in general, the United Nations recognized holiday?</p>\r\n<p>Buddha or blast is a Buddhist festival is considered one of the most important festivals of Buddhism because other memorial tributes remember the three major events in the era of Buddha samonkotam the day of his birth, enlightenment and Nirvana. These three events are happening on the same day 15 penhbaunrmi the moon, full moon in June the same year.</p>', '<p>No specific Location! Normall help at every pagoda.</p>', '<p>No contact info</p>', '11.535810982690311,104.82935070293024,12', 1, 'Phnom Penh', '[{"filename":"add_attachment_0_1490779809.jpg","des":"Visak Bochea 1"},{"filename":"add_attachment_1_1490779809.jpg","des":"Visak Bochea 2"},{"filename":"add_attachment_2_1490779809.jpg","des":"Visak Bochea 3"},{"filename":"add_attachment_3_1490779809.jpg","des":"Visak Bochea 4"},{"filename":"add_attachment_4_1490779810.jpg","des":"Visak Bochea 5"}]', 43, 0, '0.00', '0.00', '2017-05-10', '2017-05-10', '2017-03-29 16:30:09', 1, NULL, NULL, 1, 1, '2017-05-18 00:00:00', 1, 1),
(21, 287, '308', 'Smart Mega Concert - RAIN', '<h2 class="oswald-bold">ATTENTION ALL RAIN FANS!</h2>\r\n<h3 class="oswald-bold">SMART IS BRINGING IN THE KING OF K-POP, RAIN (LEE YONG JAE).<br />LIVE IN CAMBODIA!</h3>\r\n<p>Save the date! Be prepared to rock all night long on 30<sup>th&nbsp;</sup> March 2017.<br />Want to get a concert pass? Hurry! Limited concert passes only!</p>\r\n<p><strong>Free to all Smart customers. No pass, no entry. </strong><br /><strong>Time: 7 pm</strong><br /><strong>Venue: Koh Pich</strong></p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><strong>--------------------------------------------------</strong></p>\r\n<p><strong>Smart Axiata Co., Ltd.,</strong> a leading mobile telecommunications company of Cambodia, currently serves over 8 million subscribers under the &ldquo;Smart&rdquo; brand. Smart Axiata is part of Axiata Group Berhad, one of the largest telecommunications groups in Asia with over 300 million customers across 10 countries.</p>\r\n<p>In January 2014, Smart launched its 4G LTE network and became the first and only mobile operator in Cambodia to provide true 4G services. 4G LTE powered by Smart, the fastest mobile Internet in Cambodia, is now available in 25 key provincial capitals as well as other key provincial cities. Smart also provides 2G, 2.5G, 3G and 3.75G mobile services, supporting the very latest in multimedia and mobile Internet services as well as international roaming across more than 190 countries. Its extensive nationwide network coverage now covers more than 98% of the Cambodian population. In September 2016, Smart launched 4G+ aka LTE Advanced using Carrier Aggregation, fostering its data leadership position in Cambodia.</p>', '<p><img src="http://visitcambodia.localhost/upload/post_attachment/resized/add_attachment_1_1490842745.jpg" alt="" width="100%" /></p>', '<p><strong>Address:</strong><br />No. 464A Monivong Blvd,<br />Sangkat Tonle Bassac<br />Khan Chamkarmorn, Phnom Penh<br />Cambodia</p>\r\n<p><strong>Telephone</strong>: <strong><a href="tel:+85510201000">+85510201000</a></strong></p>\r\n<p><strong>Email:<br />Customer service:&nbsp;<a href="mailto:888@smart.com.kh">888@smart.com.kh</a><br />Other requests:&nbsp;<a href="mailto:info@smart.com.kh">info@smart.com.kh</a></strong></p>\r\n<p>Please call our Smart 24/7 Call Center to get information about our products and services:<br /><strong><a href="tel:888">888</a> or <a href="tel:+85510200888">+85510200888</a></strong></p>', '11.556095095190233,104.9415135383606,15', 1, 'Koh Pich', '[{"filename":"add_attachment_0_1490842745.png","des":""},{"filename":"add_attachment_1_1490842745.jpg","des":""},{"filename":"add_attachment_2_1490842747.png","des":""}]', 132, 0, '0.00', '0.00', '2017-03-30', '2017-03-30', '2017-03-30 09:59:05', 1, '2017-05-02 14:50:44', 1, 1, 1, '2017-05-18 00:00:00', 1, 1),
(22, 288, '294', 'Angkor Wat Temple', '<p>Angkor Wat is the most famous of the Angkorian temples. Back in the twelfth century when it was built by King Suryavarman II, it was a temple dedicated to the Hindu god, Vishnu and took an estimated 30 years to build. It was later&nbsp;dedicated to Buddhism and is the only one of the Angkorian temples to remain in religious use throughout the centuries.</p>\r\n<p>Unusually for the Khmer temple, it''s orientated to the West which has led experts to deduce that it was a funeral temple for King Suryavarman II, because it faces the setting sun. Also, bas-reliefs are designed to be viewed from left to right in keeping with Hindu death rituals.</p>\r\n<p>UNESCO has called Angkor Wat ''''One the most important archaeological sites in South-East Asia'''' and it is coined the 7th Wonder of the World and it truly deserves these epithets.</p>', '', '', '13.412663832621458,103.86680603027344,12', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496046715.jpg","des":""}]', 126, 1, '0.00', '0.00', NULL, NULL, '2017-05-02 16:20:48', 5, '2017-08-16 14:39:25', 1, 1, 5, '2017-05-18 00:00:00', 1, 1),
(23, 288, '294', 'Angkor Thom Temple', '<p>This fortified city was built by King Jayavarman VII in the late twelfth century, encapsulated the residences of priests, officials, militaries, and administrative staffs.</p>\r\n<p>Peering out from between the tree branches are the old gods still protecting this ancient city and below them is a huge moat that surrounds the large outer wall. There are a number of entry towers each with a causeway flanked by 54 stone figures on either side-demons to the right and gods to the left, totaling the magical number of 108 deities guarding the city.</p>\r\n<p style="text-align: left;">Inside the city are important monuments such as the Bayon temple, the Baphuon, the Royal Enclosure, Phimeanakas and the Terrace of Elephants.</p>', '', '', '13.44104306316053,103.8592529296875,12', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496646140.jpg","des":""},{"filename":"add_attachment_1_1496646141.jpg","des":""},{"filename":"add_attachment_2_1496646141.jpg","des":""},{"filename":"add_attachment_3_1496646141.jpg","des":""}]', 50, 0, '0.00', '0.00', NULL, NULL, '2017-05-02 16:38:14', 5, '2017-06-05 14:02:20', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(24, 288, '294', 'Bayon Temple', '<p>The Bayon is a richly decorated Khmer temple built in the late twelfth or early thirteenth century. Constructed at the center of King Jayavarman&rsquo;s capital, Angkor Thom, this was the last state temple to be built at Angkor. The Bayon Temple, the only Angkorian state temple, was built primarily as a Mahayana Buddhist shrine dedicated to Buddha. Following Jayavarman&rsquo;s death, it was modified and augmented by later Hindu and Theravada Buddhist Kings in accordance to their religious preferences.</p>\r\n<p>The Bayon&rsquo;s most distinctive feature is the multitude of serene and massive stone faces on the many towers that jut from the upper terrace and cluster around its center peak.</p>\r\n<p>The similarity of the 216 gigantic faces to other statues of Jayavarman VII has led many scholars to the hypothesis that the faces are representations of the King himself. Others believe that the faces belong to Avalokitesvara, the bodhisattva of compassion. &nbsp;&nbsp;</p>', '', '', '13.441382545891255,103.85886669158936,12', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496862175.jpg","des":""},{"filename":"add_attachment_1_1496862175.jpg","des":""}]', 39, 0, '0.00', '0.00', NULL, NULL, '2017-05-02 17:39:22', 5, '2017-06-08 02:02:55', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(25, 288, '294', 'Elephant Terrace', '<p>The Terrace of the Elephants is part of the walled city of Angkor Thom used by King Jayavarman VII as a platform from which to view his victorious returning army. It was attached to Phimean Akas. Most of the original structure was made of organic material and has long since disappeared. Much of what remains are the foundation platforms of the complex. The terrace is named for the carvings of Elephants on its eastern face.</p>', '', '', '13.446266054793396,103.85873794555664,15', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496862359.jpg","des":""},{"filename":"add_attachment_1_1496862360.jpg","des":""},{"filename":"add_attachment_2_1496862360.jpg","des":""}]', 33, 0, '0.00', '0.00', NULL, NULL, '2017-05-03 08:59:02', 5, '2017-06-08 02:05:59', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(26, 288, '294', 'Sour Prat Temple', '<p>Sour Prat temple is a row of twelve towers that span from north to south, lining the eastern side of Royal square and just opposite the Elephant Terrace. This was possibly built during the reign of Indravarman II. The towers are made from rugged laterite and sand-stone. Translated, the name means &ldquo;the towers of the right-rope dancers&rdquo; ,which is derived from a local belief that they were once used to support a high wire stretched between them for acrobatic acts during royal festivals. &nbsp;&nbsp;&nbsp;&nbsp;</p>', '', '', '13.444403446148641,103.86058866977692,16', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496862040.jpg","des":""}]', 36, 0, '0.00', '0.00', NULL, NULL, '2017-05-03 10:07:38', 5, '2017-06-08 02:00:40', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(27, 288, '294', 'Baphuon Temple', '<p>Baphuon is a three-tiered temple mountain built as the state temple of Udayadityavarman II in the mid-11<sup>th</sup> century in Angkor Thom, northwest of the Bayon. Dedicated to the Hindu God Shiva, the temple is the archetype of the Baphuon style. It adjoins the southern enclosure of the royal palace and measures 120 meters east-west by 100 meters north-south at its base and stands 34 meters tall without its towers, which would have made it roughly 50 meters tall. &nbsp;&nbsp;&nbsp;</p>', '', '', '13.443907791549751,103.8562273979187,16', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496861841.jpg","des":""},{"filename":"add_attachment_1_1496861841.jpg","des":""}]', 27, 0, '0.00', '0.00', NULL, NULL, '2017-05-03 10:49:36', 5, '2017-06-08 01:57:21', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(28, 288, '294', 'Phimean Arkas', '<p>At Angkor, Cambodia, is a Hindu temple in the Khleang style, built at the end of the 10<sup>th</sup> century. During the reign of Rajendravarman(from 941-968), then completed by Suryavarman in the shape of a three tier pyramid as a Hindu temple. On the top of pyramid there was a tower, while on the edge of top platform there are galleries. Phimeanakas is located inside the walled enclosure of the Royal Palace of Angkor Thom north of Baphuon.</p>', '', '', '13.445713012841232,103.85627031326294,16', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496861376.jpg","des":""},{"filename":"add_attachment_1_1496861376.jpg","des":""},{"filename":"add_attachment_2_1496861377.jpg","des":""}]', 54, 0, '0.00', '0.00', NULL, NULL, '2017-05-03 11:16:06', 5, '2017-06-08 01:49:36', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(29, 288, '291,293', 'Mangrove Forests', '<p>Cambodia is blessed with around 50,000 hectares of mangrove forests. In the Boeng Kayak area, there is an elevated walkway where guests can explore this unique habitat. The project there provides opportunity for exploration and tourism as well as jobs for surrounding villagers.</p>\r\n<p>Raised walkways make it clean and convenient to enjoy the mangrove forest.</p>\r\n<p>These woody types of tropical trees thrive on the edge where rainforests meet oceans and collectively, they exude a unique form of natural beauty that puts the observer in awe. It is reported that there are about more than 4.25 million hectares of mangrove forests found in Southeast Asia and Cambodia, Mangroves are spread along the coast from Kep to Koh Kong, covering an area of over 50.000 hectares in Koh Kong alone.</p>\r\n<p>50,000 hectares of mangrove forests to explore.</p>\r\n<p>Mangroves serve as rookeries, or nesting areas, for many coastal birds.</p>\r\n<p>One of the most biologically diverse forests, these &lsquo;rainforests by the sea&rsquo; are the breeding grounds for spiders, shrimps, prawns, crabs, shellfish, snails and fishes; especially the beautiful mudskippers that seem to enjoy the surface more than being in water. Mangrove forests ​are also nesting sites for many shore birds and home to lizards, sea turtles, and many other animal species. For many species of fruit bats, like the dawn bat, mangrove blossoms and fruits make up a large part of their diet.</p>\r\n<p>For the keen eco-lover, come visit the mangrove forest of Koh Kong where you will be rewarded by hours of awesome thrills just by observing these natural wonders and the lives that evolve in their midst.</p>', '', '', '11.426141975408934,103.02635192871094,11', 10, 'Koh Kong Province', '[]', 0, 0, '0.00', '0.00', NULL, NULL, '2017-05-03 14:42:15', 5, NULL, NULL, 1, 5, '2017-05-18 00:00:00', 1, 0),
(30, 288, '295,296', 'Province', '<p><strong>Kratie Province</strong></p>\r\n<p>Kratie (pronounced Kror-ches) is a relatively quiet town that is located on the east bank of the Mekong River. It is approx. 315 km from the city of Phnom Penh and famous for his resident Irrawaddy dolphins to make a very popular destination. This is a very beautiful town with plenty of big islands and sandbars. There are plenty of attractive homes throughout the town that have French and Khmer architecture, with many of the older buildings relatively unscathed from the war years, a great reason to explore this pleasant town is ability to view the local freshwater Irrawaddy dolphin population. This is only possible in this one town across the entire country of Cambodia.</p>\r\n<p>It is easy to see the dolphins by taking a 25minutes boat ride that also makes it possible to admire the authentic life of the local Cambodians. This boat ride can also include visiting a temple in the mountains and the rapids upstream. The town of kratie has a vibrant market scene that makes it possible to take in the rural Cambodia life and sample some of the local delicacies (Such as the grilled corn cakes).In addition, this town is conveniently placed about midway between Phnom Penh and Rattanakiri. Whether it is staying in town for several days or overnight, this is a great layover for those planning to visit Laos on the Cambodia package tours, or simply visiting to see the prime attraction in Kratie: fresh water dolphins.</p>\r\n<p>&nbsp;</p>', '', '', '12.45651300882462,106.0345458984375,7', 11, 'Kratie', '[]', 1, 0, '0.00', '0.00', NULL, NULL, '2017-05-03 14:57:43', 5, '2017-05-03 16:55:46', 5, 1, 5, '2017-05-18 00:00:00', 1, 0);
INSERT INTO `v_items` (`id`, `type_id`, `cate_id`, `title`, `description`, `transportation_info`, `contact_info`, `map`, `provincecity`, `address`, `filenames`, `views`, `top_attraction`, `price_from`, `price_to`, `start_date`, `end_date`, `created_date`, `created_by`, `last_updated_date`, `last_updated_by`, `approved`, `approved_by`, `approved_date`, `active_by_user`, `active`) VALUES
(31, 288, '294', 'Ta Prohm Temple', '<p>Built similar in style to the Bayon during the late twelfth century, this was originally a Mahayana Buddhist monastery and university. It is a very popular attraction for visitors to Angkor because it has been left much the same as it was discovered &ndash;with giant roots snaking through doorways and trees overhanging grey stone.</p>\r\n<p>Ta Prohm was originally named &ldquo;Rajavihara&rdquo; which means &ldquo;Monastery of the King.&rdquo; Different aspects are dedicated to important figures in the King&rsquo;s life such as his mother, guru and elder brother. As such, this temple forms a complementary pair with the temple monastery of Preah Khan which was modeled on the King&rsquo;s father.</p>\r\n<p>When it was new and thriving, the site hosted more than 12,500 people (including 18 high priests and 615 dancers) and a further 800,000 people in surrounding villages made their living working there. Expansions and additions to the temple continued through into the rule of Srindravarman at the end of the 15<sup>th</sup> century. &nbsp;</p>', '', '', '13.434808434510469,103.8892936706543,14', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496861102.jpg","des":""},{"filename":"add_attachment_1_1496861102.jpg","des":""},{"filename":"add_attachment_2_1496861102.jpg","des":""}]', 29, 0, '0.00', '0.00', NULL, NULL, '2017-05-03 15:30:08', 5, '2017-06-08 01:45:02', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(32, 288, '294', 'Preah Khan Temple', '<p>In the heyday, this was the center of a substantial organization with almost 100,000 officials and servants. This temple is flat in design, with a basic plan of successive rectangular galleries around a Buddhist sanctuary complicated by Hindu satellite temples and numerous later additions. With numerous trees and other vegetation growing among the ruins, Preah Khan has been left largely unrestored.</p>\r\n<p>Preah Khan, for the beguiler, the romancer and the artist, is an entrancing mastery deep in the jungle, soft and alluring in the twilight made by heavy verdure. &nbsp;&nbsp;&nbsp;&nbsp;</p>', '', '', '13.461917656119539,103.87184858322144,14', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496848331.jpg","des":""},{"filename":"add_attachment_1_1496848331.jpg","des":""},{"filename":"add_attachment_2_1496848332.jpg","des":""}]', 33, 0, '0.00', '0.00', NULL, NULL, '2017-05-03 15:59:49', 5, '2017-06-07 22:12:11', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(33, 288, '294', 'Banteay Kdei Temple', '<p>Banteay Kdei means &ldquo;Citadel of Chambers&rdquo; with the chambers referring to monk&rsquo;s abodes. It was again built by Jayavarman VII and is an example of the Bayon architectural style-similar to Ta Prohm and Preah Khan. Banteay Kdei was used by monks throughout the ages up until the 1960s.</p>\r\n<p>The structures are contained within two successive enclosure walls and two concentric galleries pointed with tall towers. Many original carvings remain.</p>', '', '', '13.4299246922621,103.89802694320679,16', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496848071.jpg","des":""},{"filename":"add_attachment_1_1496848071.jpg","des":""},{"filename":"add_attachment_2_1496848072.jpg","des":""}]', 30, 0, '0.00', '0.00', NULL, NULL, '2017-05-03 16:24:21', 5, '2017-06-07 22:07:51', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(34, 288, '291,293', 'Mangrove Forests', '<p>50,000 hectares of mangrove forests to explore.</p>\r\n<p>Mangroves serve as rookeries, or nesting areas, for many coastal birds.</p>\r\n<p>One of the most biologically diverse forests, these &lsquo;rainforests by the sea&rsquo; are the breeding grounds for spiders, shrimps, prawns, crabs, shellfish, snails and fishes; especially the beautiful mudskippers that seem to enjoy the surface more than being in water. Mangrove forests ​are also nesting sites for many shore birds and home to lizards, sea turtles, and many other animal species. For many species of fruit bats, like the dawn bat, mangrove blossoms and fruits make up a large part of their diet.</p>\r\n<p>For the keen eco-lover, come visit the mangrove forest of Koh Kong where you will be rewarded by hours of awesome thrills just by observing these natural wonders and the lives that evolve in their midst.</p>', '', '', '11.417078257649152,103.02120208740234,14', 10, 'Koh Kong Province', '[{"filename":"add_attachment_0_1496845200.jpg","des":""},{"filename":"add_attachment_1_1496845201.jpg","des":""},{"filename":"add_attachment_2_1496845201.jpg","des":""}]', 44, 0, '0.00', '0.00', NULL, NULL, '2017-05-03 17:05:21', 5, '2017-10-26 15:58:01', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(35, 288, '294', 'Sras Srang', '<p>Srah Srang was a reservoir (Baray), measuring 700m by 350m that is still partially flooded. Located south of the East Baray and east of Banteay Kdei (opposite the entrance) this is a popular site for watching the sunrise. It was dug in the mid-10<sup>th</sup> century by Rajendravarman II and was later modified around the year 1200 by Jayavarman VII. The steps that lead to the water are flanked by two guardian lions.</p>', '', '', '13.430321239144483,103.90321969985962,15', 17, 'Siem Reap', '[]', 0, 0, '0.00', '0.00', NULL, NULL, '2017-05-08 09:07:54', 5, NULL, NULL, 1, 5, '2017-05-18 00:00:00', 1, 0),
(36, 288, '294', 'Sras Srang', '<p>Srah Srang was a reservoir (Baray), measuring 700m by 350m that is still partially flooded. Located south of the East Baray and east of Banteay Kdei (opposite the entrance) this is a popular site for watching the sunrise. It was dug in the mid-10<sup>th</sup> century by Rajendravarman II and was later modified around the year 1200 by Jayavarman VII. The steps that lead to the water are flanked by two guardian lions.</p>', '', '', '13.430321239144483,103.9031982421875,15', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496646914.jpg","des":""},{"filename":"add_attachment_1_1496646915.jpg","des":""},{"filename":"add_attachment_2_1496646915.jpg","des":""}]', 25, 0, '0.00', '0.00', NULL, NULL, '2017-05-08 09:09:45', 5, '2017-06-05 14:15:14', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(37, 288, '294', 'Bakong Temple', '<p>Bakong is the first temple mountain of sandstone constructed by rulers of the Khmer empire at Angkor near modern Siem Reap in Cambodia. In the final decades of the 9<sup>th</sup> century AD, it served as the official state temple of King Indravarman I in the ancient city of Hariharalaya, located in an area that today is called Roluos.</p>', '', '', '13.336008154178636,103.97392272949219,14', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496844906.jpg","des":""},{"filename":"add_attachment_1_1496844907.jpg","des":""},{"filename":"add_attachment_2_1496844907.jpg","des":""}]', 27, 0, '0.00', '0.00', NULL, NULL, '2017-05-08 09:23:27', 5, '2017-06-07 21:15:06', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(38, 288, '294', 'Thommanon Temple', '<p>Thommanon is one of a pair of Hindu temples built during the reign of Suryavarman II (from 1113-1150) at Angkor, Cambodia. This small and elegant temple is located east of the Gate of the Victory of Angkor Thom and north of Chau Say Tevoda. It is part of the UNESCO World Heritage Site, inscribed by UNESCO in 1992 titled Angkor. The temple is dedicated to Shiva and Vishnu.</p>', '', '', '13.447267787909967,103.8776421546936,16', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496814734.jpg","des":""},{"filename":"","des":""}]', 25, 0, '0.00', '0.00', NULL, NULL, '2017-05-08 09:49:38', 5, '2017-06-07 12:52:14', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(39, 288, '294', 'Pre Rup Temple', '<p>The temple&rsquo;s name is a comparatively modern one meaning &ldquo;turn the body&rdquo;. This reflects the common belief among Cambodians that funerals were conducted at the temple, with the ashes of the body being ritually rotated in different directions as the service progressed.</p>', '', '', '13.434975398299738,103.920578956604,15', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496814190.jpg","des":""},{"filename":"add_attachment_1_1496814191.jpg","des":""}]', 25, 0, '0.00', '0.00', NULL, NULL, '2017-05-08 10:03:01', 5, '2017-06-07 12:43:10', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(40, 288, '294', 'Kravan Temple', '<p>Prasat Kravan is almost an afterthought on the map, but it sure looks great at sunrise. The key features here are the huge carvings within each of the towers, which were a pleasant surprise at this otherwise lonely site.</p>', '', '', '13.419760345915126,103.89976501464844,15', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496803471.jpg","des":""},{"filename":"add_attachment_1_1496803472.jpg","des":""},{"filename":"add_attachment_2_1496803473.jpg","des":""}]', 25, 0, '0.00', '0.00', NULL, NULL, '2017-05-08 10:14:38', 5, '2017-06-07 09:44:31', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(41, 288, '294', 'Neak Pean Temple', '<p>Neak Pean is one of the temples that make one dream of the olden days of luxury and beauty. It was worthwhile to the overpowering temples of Siva that men and armies repaired, but it was at the tiny temple of Neak Pean that eager princesses laid their lovely offerings of wrought gold and pungent perfumes.</p>', '', '', '13.463307990559315,103.89491558074951,15', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496802927.jpg","des":""},{"filename":"add_attachment_1_1496802927.jpg","des":""},{"filename":"add_attachment_2_1496802927.jpg","des":""},{"filename":"","des":""},{"filename":"add_attachment_4_1496802928.jpg","des":""}]', 24, 0, '0.00', '0.00', NULL, NULL, '2017-05-08 10:33:33', 5, '2017-06-07 09:35:27', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(42, 288, '294', 'Banteay Samre Temple', '<p>Banteay Samre Temple is located in the Angkor Temple Complex in Cambodia, it was built under Suryavarman II and Yosavarman II in the early 12<sup>th</sup> century. Banteay Samre Temple is worshiped Vishnu of India, this temple was built with the architecture the same as Angkor Wat Temple. This is one of the Temple which is belonged to Angkor Temple Complex and it is resorted completely by the anastylosis method. However, almost of the valuable things in this temple were stolen.</p>', '', '', '13.442024294726473,103.95917594432831,15', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496802535.jpg","des":""},{"filename":"add_attachment_1_1496802535.jpg","des":""},{"filename":"add_attachment_2_1496802536.jpg","des":""}]', 21, 0, '0.00', '0.00', NULL, NULL, '2017-05-08 10:57:14', 5, '2017-06-07 09:28:55', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(43, 288, '294', 'Ta Keo Temple', '<p>One of the tallest monuments of Angkor, the Ta Keo is a mountain temple built by Jayavarman V. Its five sanctuaries are placed on top of a 22 meter high five stepped pyramid, from where there are good views of the surrounding area. The pyramid shaped Ta Keo was built to represent Mount Meru, the mountain that is the center of the world in Hindu mythology. The massive sandstone monument dedicated to Shiva was left unfinished at the start of the 11<sup>th</sup> century. Work on the Ta Keo was halted at a time when sculptors began to add decorations to the temple. The reason why work stopped is not known.</p>', '', '', '13.444565185848576,103.88231992721558,17', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496801990.jpg","des":""},{"filename":"add_attachment_1_1496801990.jpg","des":""},{"filename":"add_attachment_2_1496801990.jpg","des":""}]', 24, 0, '0.00', '0.00', NULL, NULL, '2017-05-08 11:24:55', 5, '2017-06-07 09:19:50', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(44, 288, '294', 'Ta Som Temple', '<p>Ta Som is small temple at Angkor, Cambodia, built at the end of the 12<sup>th</sup> century for King Jayavarman VII. It is located north east of Angkor Thom and just east of Neak Pean. The king dedicated the temple to his father Dharanindravarman II (Paramanishkalapada) who was King of the Khmer Empire from 1150 to 1160. The temple consists of a single shrine located on one level and surrounded by enclosure laterite walls. Like the nearby Preah Khan and Ta Prohm the temple was left largely unrestored, with numerous trees and other vegetation growing among the ruins.</p>', '', '', '13.464609628427361,103.91297221183777,15', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496801397.jpg","des":""},{"filename":"add_attachment_1_1496801397.jpg","des":""},{"filename":"add_attachment_2_1496801398.jpg","des":""},{"filename":"add_attachment_3_1496801398.jpg","des":""}]', 28, 0, '0.00', '0.00', NULL, NULL, '2017-05-09 09:51:58', 5, '2017-06-07 09:09:57', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(45, 288, '294', 'East Mebon', '<p>East Mebon is a 10<sup>th</sup> century temple at Angkor, Cambodia. Built during the reign of King Rajendravarman, it stands on what was an artificial island at the center of the now dry East Baray reservoir. The East Mebon was dedicated to the Hindu god Shiva and honors the parents of the king. Its location reflects Khmer architects&rsquo; concern with orientation and cardinal directions. The temple was built on a north south axis with Rajendravarman&rsquo;s state temple, Pre Rup, located about 1200 meter to the south just outside the Baray. The East Mebon also lies on an east-west axis with the palace temple Phimean Akas, another creation of Rajendravarman&rsquo;s reign,​​ located about 6800 meter due west. &nbsp;&nbsp;&nbsp;</p>', '', '', '13.446704313547158,103.91999959945679,15', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496801075.jpg","des":""},{"filename":"add_attachment_1_1496801075.jpg","des":""},{"filename":"add_attachment_2_1496801076.jpg","des":""}]', 26, 0, '0.00', '0.00', NULL, NULL, '2017-05-09 10:44:09', 5, '2017-06-07 09:04:35', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(46, 288, '294', 'Phnom Bakheng Temple', '<p>This is a Hindu temple originally built in the form of a mountain temple dedicated to Shiva. Historians believe that Phnom Bakheng was in its heyday, the principal temple of the Angkor region. It was the architectural centerpiece of a new capital that Yasovarman built when he moved the court from the capital Hariharalaya in the Roluos area located to the southeast.</p>\r\n<p>Located atop the hill, Phnom Bakheng is the most popular tourist spot for sunset views of the much bigger Angkor Wat temple which lies amid the jungle about 1.5km to the southeast.</p>', '', '', '13.423809438951407,103.85603427886963,14', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496800725.jpg","des":""},{"filename":"add_attachment_1_1496800725.jpg","des":""},{"filename":"add_attachment_2_1496800726.jpg","des":""}]', 29, 0, '0.00', '0.00', NULL, NULL, '2017-05-09 14:33:58', 5, '2017-06-07 08:58:45', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(47, 288, '294', 'Baksei Chamkrong Temple', '<p>Baksei Chamkrong temple is located 150m north of Bakheng mountain and 80m from the road leading to the south gate of Angkor Thom. It was built in middle of the tenth century (947), perhaps begun by Harshavarman I and completed by Rajendravarman II, dedicated to Siva (Hindu) may have been a funerary temple for the parents of the king with following traditional between Bakheng and Kor Ker. It was the first temple-mountain at Angkor built entirely of durable materials brick, laterite and sandstone.</p>', '', '', '13.425395662967262,103.8583517074585,15', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496648755.jpg","des":""},{"filename":"add_attachment_1_1496648755.jpg","des":""},{"filename":"add_attachment_2_1496648755.jpg","des":""}]', 27, 0, '0.00', '0.00', NULL, NULL, '2017-05-09 14:50:24', 5, '2017-06-05 14:45:55', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(48, 288, '292', 'Kulen Mountain', '<p>The Kulen Mountain is declared as a national park. It&rsquo;s about 30km northwards from Angkor Wat. It name means &ldquo;mountain of the lychee&rdquo; with the highest point about 487 meters. It is considered a holy mountain in Cambodia, of special religious significance to Hindus and Buddhists who come to the mountain in pilgrimage. This widely regarded as the birthplace of the ancients Khmer Empire. During the constructional period of the ancient temples in the nineth century, sandstones were brought from this sacred mountain to Angkor. It was here at Phnom Kulen that King Jayavarman II proclaimed independence from Java in 802 A.D. This mountain plateau served as the capital of the first Khmer Empire for more than half a century before it moved to Roluos. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '', '', '13.643651383348415,104.14661407470703,10', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496648290.jpg","des":""},{"filename":"add_attachment_1_1496648290.jpg","des":""},{"filename":"add_attachment_2_1496648291.jpg","des":""}]', 36, 0, '0.00', '0.00', NULL, NULL, '2017-05-09 15:24:29', 5, '2017-06-05 14:38:10', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(49, 288, '292', 'Kbal Spean', '<p>Kbal Spean (Bridge Head) is an Angkorian era archaeological site on the southwestern slopes of the Kulen Hills to the northeast of Angkor. It is situated along a 150m stretch of the Stung Kbal Spean River, 25kilometres (16mi) from the main Angkor group of monuments. The site consists of a series of stone rock relief carvings in sandstone formations of the river bed and banks. It is commonly known as the &ldquo;Valley of a 1000 Lingas&rdquo; or &ldquo;The River of a Thousand Lingas&rdquo;. The motifs for stone carvings are mainly myriads of lingams (phallic symbol of Hindu god Shiva), depicted as neatly arranged bumps that cover the surface of a sandstone bed rock, and lingam-yoni designs. There are also various Hindu mythological motifs, including depictions of the gods Shiva, Vishnu, Brahma, Lakshmi, and Hanuman, as well as animals (cows and frogs). &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '', '', '13.68635276142926,104.01546478271484,12', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496647397.jpg","des":""},{"filename":"add_attachment_1_1496647397.jpg","des":""}]', 38, 0, '0.00', '0.00', NULL, NULL, '2017-05-09 15:53:35', 5, '2017-06-05 14:23:17', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(50, 288, '294', 'Beng Mealea', '<p>Beng Mealea is about 68km northeast of Siem Reap. This is probably one of the most mysterious temples at Angkor having been badly run in by nature. Built to same floor plan as Angkor Wat in the 12<sup>th</sup> century under Suryavarman II, the temple is also enclosed by a massive moat measuring 1.2km by 900m.</p>\r\n<p>It used to be utterly consumed by jungle, but some of the dense foliage has been cleaned up in recent years. Piles of finely chiseled sandstone blocks and long dark chambers with hanging vines in between may at first discourage, but this temple is actually a place worth spending the time exploring. The rewards include several impressive carvings besides a well-preserved library in the north-eastern quadrant and much more. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>', '', '', '13.475565017220449,104.22879695892334,12', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496641426.jpg","des":""},{"filename":"add_attachment_1_1496641427.jpg","des":""},{"filename":"add_attachment_2_1496641427.jpg","des":""}]', 38, 0, '0.00', '0.00', NULL, NULL, '2017-05-09 16:15:15', 5, '2017-06-05 12:43:46', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(51, 288, '294', 'Banteay Srei Temple', '<p><img style="float: right; margin: 0px 0px 10px 10px;" src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1496221194.jpg" width="30%" />Banteay Srei is a 10<sup>th</sup>-century temple was dedicated to the Hindu god Shiva. Its name means &ldquo;Citadel of Women&rdquo; and is the only major temple of Angkor not built by a monarch. Instead credit went to a courtier, Yajnavaraha-a famous scholar and philanthropist.</p>\r\n<p>Banteay Srei is constructed from red sandstone and many of its elements appear in comparatively miniature form making it unique among the Angkorian temples. Almost every surface has been hacked into beautiful shapes and depictions that can still be admired today. Motifs include fierce monsters, multiple-armed protectors, goddesses and false doors. Indeed, the &lsquo;near perfect ornamental technique'' is praised by every visitor to the temple.</p>\r\n<p><img src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_1_1496221195.jpg" width="50%" /><img src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_2_1496221195.jpg" width="44%" /></p>', '', '', '13.598960956702964,103.96300077438354,9', 17, 'Siem Reap', '[{"filename":"add_attachment_0_1496221194.jpg","des":""},{"filename":"add_attachment_1_1496221195.jpg","des":""},{"filename":"add_attachment_2_1496221195.jpg","des":""}]', 49, 0, '0.00', '0.00', NULL, NULL, '2017-05-09 16:37:48', 5, '2017-06-01 22:27:57', 1, 1, 5, '2017-05-18 00:00:00', 1, 1),
(52, 288, '294', 'Preah Vihear Temple', '<p><img style="width: 50%; float: right; margin: 0px 0px 10px 10px;" src="http://visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1496211436.jpg" width="50%" />The Preah Vihear Temple is a khmer temple situated spectacularly</p>\r\n<p>Atop Poy Tadi, a 525-metres (1720ft) cliff in the Dangrek Mountains</p>\r\n<p>Located in the&nbsp; Preah Vihear Province of northern Cambodia.</p>\r\n<p>Preah Vihear command spectacular views from its position atop a 525 meters cliff in the Dangrek Mountains. It is a Hindu temple dedicated to Shiva, and was built during the Khmer Empire. It enjoys the best setting of any other Angkorian temple with views extending many miles in all directions. It&rsquo;s long been held in great esteem and is a key part of religious life in Cambodia. Stylistically, it&rsquo;s a unique take on the &ldquo;Mount Meru&rdquo; theme, in other words, it was built to represent the home of the gods. This Cambodian temple was declared a World Heritage Site by UNESCO in July 7, 2008.</p>\r\n<p><img src="http://visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1496213459.jpg" width="50%" /></p>', '', '', '14.39161926053367,104.68013763427734,13', 13, 'Preah Vihear', '[{"filename":"add_attachment_0_1496211436.jpg","des":""},{"filename":"add_attachment_0_1496213459.jpg","des":""},{"filename":"add_attachment_0_1496214143.jpg","des":""}]', 63, 0, '0.00', '0.00', NULL, NULL, '2017-05-09 17:10:28', 5, '2017-07-14 10:53:34', 1, 1, 5, '2017-05-18 00:00:00', 1, 1),
(53, 288, '294', 'Kor Ker', '<p>Koh Ker is a remote archaeological site about 120 kilometers (75 mi) away from Siem Reap in northern Cambodia. This is one of the latest ancient sites of Angkor to be discovered and has since 1992 been on the UNESCO tentative world heritage list. More than 180 sanctuaries were found in a protected 81 square kilometers (31sq mi) area and only about two dozen monuments can be visited by tourists because most of the sanctuaries are hidden in the forest and the whole area is yet to be fully demined. In inscriptions, the town is mentioned as Lingapura (city of lingams) or Chok Gargyar. Under the reign of the kings Jayavarman IV and Harshavarman II, Koh Ker was briefly the capital of the whole empire (928-944 AD). &nbsp;</p>\r\n<p><img src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1496210714.jpg" alt="" width="50%" height="50%" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><img style="float: right; margin: 0px 0px 10px 10px;" src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1496639063.jpg" alt="" width="411" height="410" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><img src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1496639255.jpg" alt="" width="506" height="337" /></p>', '', '', '13.78311105147137,104.53720808029175,9', 13, 'Preah Vihear', '[{"filename":"add_attachment_0_1496210714.jpg","des":""},{"filename":"add_attachment_0_1496639063.jpg","des":""},{"filename":"add_attachment_0_1496639255.jpg","des":""}]', 57, 0, '0.00', '0.00', NULL, NULL, '2017-05-09 17:35:28', 5, '2017-06-05 12:12:40', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(54, 288, '294', 'Banteay Chmar Temple', '<p>Banteay Chmar Temple is one of the more important yet least understood temples from the Angkorian period. The complex, moat, baray (reservoir) and largely unspoilt environment constitute a unique archaeological site and an important link to the country&rsquo;s cultural heritage, Commissioned in the late 12<sup>th</sup> to early 13<sup>th</sup> century by King Jayavarman VII, this temple complex consist a total of nine satellite temples.</p>', '', '', '14.071000667028676,103.09978008270264,9', 2, 'Banteay Meanchey', '[{"filename":"add_attachment_0_1496640429.jpg","des":""},{"filename":"add_attachment_1_1496640429.jpg","des":""},{"filename":"add_attachment_2_1496640429.jpg","des":""}]', 97, 0, '0.00', '0.00', NULL, NULL, '2017-05-09 17:56:04', 5, '2017-06-05 12:27:09', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(55, 288, '294', 'Sambo Prei Kuh Temple', '<p>Sambo Preh Kuh was once the capital of Chenla - a civilisation that thrived before Angkor. It was founed by King Isanvarman I in the seventh century. As such it is home to a fascinating archeological wonder - over 100 temples built by successive kings.</p>\r\n<p><img src="http://visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1500361227.jpg" alt="" width="50%" height="50%" /></p>\r\n<p><img src="http://visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1496127500.jpg" alt="" width="50%" height="50%" /></p>\r\n<p>&nbsp;</p>\r\n<p><img src="http://visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1500360948.jpg" alt="" width="50%" height="50%" /></p>\r\n<p><img src="http://visitcambodia.travel/upload/post_attachment/resized/add_attachment_1_1500361227.jpg" alt="" width="50%" height="50%" /></p>\r\n<p><img src="http://visitcambodia.travel/upload/post_attachment/resized/add_attachment_1_1500360948.jpg" alt="" width="50%" height="50%" /></p>\r\n<p><iframe src="https://www.youtube.com/embed/tOEIlz1Rikg?ecver=1" width="560" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe></p>\r\n<p>&nbsp;</p>', '', '', '12.871091401510949,105.04328727722168,10', 7, 'Kampong Thom', '[{"filename":"add_attachment_0_1496127500.jpg","des":""},{"filename":"add_attachment_0_1500360948.jpg","des":""},{"filename":"add_attachment_1_1500360948.jpg","des":""},{"filename":"add_attachment_0_1500361227.jpg","des":""},{"filename":"add_attachment_1_1500361227.jpg","des":""}]', 111, 0, '0.00', '0.00', NULL, NULL, '2017-05-09 18:07:32', 5, '2017-08-01 15:45:11', 5, 1, 5, '2017-05-18 00:00:00', 1, 1),
(56, 288, '292', 'Kirirom National Park', '<h2><strong>Kirirom National Park</strong></h2>\r\n<p>A Two-hour drive from Phnom Penh is Kirirom National Park, Visitors come here to see the high elevation pine forest and explore the ruined town and several mansions that belonged to the king in the 1950s.As well as that, visitors can also walk among the trees, view the forests of the Cardamom Mountains and frolic beneath waterfalls. The destination was a favorite during the colonial times and its rare plants and cool climate make it a refreshing break indeed, it was forgotten until recently when new investors started providing innovative accommodations, camping activities and tours around this tranquil forest. There is now a resort with container home and ground tent where tourists can experience the cool mountain environment and traditional ways of life.</p>\r\n<p>&nbsp;</p>', '', '', '11.350796722383672,104.04876708984375,7', 6, 'Phnom Sruoch Districk,Kompong speu province', '[]', 1, 0, '0.00', '0.00', NULL, NULL, '2017-05-12 09:26:36', 5, NULL, NULL, 1, 5, '2017-05-18 00:00:00', 1, 0),
(57, 288, '291', 'Kompot province', '<p>`</p>\r\n<p><strong>Kampot Province </strong></p>\r\n<p>Kampot was once a sleepy city that is now transformed into a very lively destination for the travelling tourist, with a variety of music venues, bars and restaurants. This city is based on the eastern side of the Kampong Bay River and within a short distance of the elephant mountains.</p>\r\n<p>The character of this city is quite different to other beach towns such as Sihanoukville, and has a more small-town ambience that is quite welcoming and quiet. This old provincial capital is rich in colonial architecture and quite lanes with certain areas appearing quite worn. There is even a partially destroyed bridge in the city centre that was bombed in the war and rebuilt using mismatched components that has created a quite iconic feature in town.</p>\r\n<p><strong>Pepper Farm </strong></p>\r\n<p>To fully discover the town, it is possible for travelers to rent a motorbike or bicycle. Other travel options include the remorgue and taxi that are very prominent throughout the town. Kampot has a quite famous food scene, especially the local fruits including the mango, coconut and durian. Kampot is well known for having the best pepper in the world, the fresh seafood and salt.</p>\r\n<p><strong>The Popokvil Waterfall </strong></p>\r\n<p>A visit to Kampot as part of a tour package of Cambodia gives a great opportunity to experience both the urban and rural side of the country. The eating and nightlife scene is seeing a lot of development, though it is still quite modest, with plenty of restaurants in town that are well worth a visit.</p>\r\n<p>This city is an excellent base for those that plan to explore the verdant countryside, the superb cave temples, Kep (including the islands and beaches), the beautiful rapids of Toek Chhou, the Bokor National Park, and other attractions of the South-East Cambodia. &nbsp;&nbsp;</p>\r\n<p><strong>Bokor National Park </strong></p>\r\n<p>The Bokor National Park is popular for its cool mountain climate and remains a year-round favorite amongst locals and foreigners alike. The scenery from the top is captivating especially in the morning hours when one can literally touch the clouds and take in fresh mountain air. With the development of a new resort type 5-star hotel on the summit, the roads have all been newly paved.</p>\r\n<p>Other attractions include the Popokvil Waterfall where the water charges incessantly to provide a pool at its base for a cool dip.</p>\r\n<p>A short distance across the track, the Toek Chhou Rapids offers yet another popular tourist attraction.</p>\r\n<p><strong>Kep </strong><strong>City </strong></p>\r\n<p>This is a relaxing seaside province situated 168 Km away from Phnom Penh. Besides the beaches, Kep is best known for having the best seafood, especially crabs. This coastal province is one of the &lsquo;must visits&rsquo; when in Cambodia. &nbsp;</p>\r\n<p>Several islands, including the popular Rabbit Island (Koh Thonsay), lay just a short boat ride off its coast.</p>\r\n<p>Freshly caught crabs are sorted according to size and usually sold even before they are brought to shore. A small section of the beach doubles as a regular crab-trading depot and this busy crab market on the water&rsquo;s edge has become a popular tourist itinerary.&nbsp;</p>\r\n<p>There are vendors who will prepare crab dishes in any which way one prefers and serve them by the beach. Crabs fried with pepper is a local specialty dish.</p>\r\n<p><strong>Koh Ton Say</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Koh Ton Say Resort is the natural resort locating at the Southest of Kep town in 4.5-kilometer distance from the town, and has two beaches suitable for swimming because they have white sand and shallow water. At the bottom of the sea, there are varied fish, plant and coral, which enable the research on ecology. It&rsquo;s such a relaxing place and you&rsquo;ll soon get down to the slow pace of life on the island. The local people are wonderful and friendly, the seafood is divine, it&rsquo;s perfect for swimming, there&rsquo;s thing to do, or you can simply chill out and kick back.</p>\r\n<p>The main beach on Rabbit Island approximately half a kilometer long. It&rsquo;s the beach that you arrive on Rabbit Island and you can see Kep across to the mainland. The beach is only a few meters wide, however, there&rsquo;s room for sun loungers, deck chairs and plenty of hammocks on the trees hugging the shoreline.</p>\r\n<p>For the best gourmet experiences, you must eat the yummy and fresh seafood which is cheap and available everywhere. Fish, shrimps, crab and squid are offered on all menus and it is all deliciously fresh, and cooked in a variety of styles.</p>\r\n<p>If you love your seafood you&rsquo;re in for a delight, and it&rsquo;s much cheaper than what you&rsquo;ll get in Kep.</p>', '', '', '11.55572124134822,104.8664653301239,14', 8, 'kompot', '[]', 8, 0, '0.00', '0.00', NULL, NULL, '2017-05-12 11:26:14', 5, NULL, NULL, 0, 1, '2017-05-18 11:54:36', 1, 1),
