(64, 288, '294', 'Wat Phnom', '<p>The Wat Phnom temple is the most significant of all the temples in Phnom Penh.</p>\r\n<p>The temple has a close-knitted relationship to the capital city. This in effect is a sanctuary founded by Daun Penh (Grandma Penh), a wealth widow who in 1372, retrieved from the river a log with five Buddha statues in it and ordered to elevate a piece of her property on which to build a temple to house the statues. The 27 meters (89 ft) high man-made hill became known as Wat Phnom Penh Daun Penh.</p>\r\n<p>Over the years, Wat Phnom has had numerous add-ons to the initial shrine that dwelt within the compound of this wonderful sanctuary. The most significant of which is the massive stupa that enshrines the ashes of King Ponhea Yat who in 1434, arrived and built the city of Phnom Penh. Wat Phnom has become a central attraction in the city and is a &lsquo;must visit&rsquo; when in Phnom Penh.</p>', '', '', '11.576130067123069,104.92313504219055,17', 1, 'Wat Phnom', '[{"filename":"add_attachment_0_1499246783.jpg","des":""},{"filename":"add_attachment_1_1499246784.jpg","des":""},{"filename":"add_attachment_2_1499246784.jpg","des":""}]', 56, 0, '0.00', '0.00', NULL, NULL, '2017-07-05 16:26:23', 5, NULL, NULL, 1, 5, '2017-07-05 16:26:23', 1, 1),
(65, 288, '294', 'INDEPENDENCE MONUMENT', '<p>Erected in 1955, the Independence Monument symbolizes Cambodian Independence gained from French colonialism in 1953.This monument is a copy of the Bankong temple (a temple from the Roluos group of the 9<sup>th</sup> century). The one-hundred Nagas and snake motif can be seen in historical, cultural, archeological, and business contexts.</p>\r\n<p>On 9<sup>th</sup> November each year, government officials from the various ministries and institutions would congregate here to jubilantly celebrate the anniversary of the national independence.</p>\r\n<p>In commemoration of the souls of brave combatants and heroes who had laid down their lives for the freedom of the country, senior military and police officers would march before the Independence Monument accompanied by a military band. The King ceremoniously lights up the &ldquo;Glory Torch&rdquo; placed inside the monument; then in a festive manner. Colorful balloons are let loose into the sky.</p>\r\n<p><strong>&nbsp;</strong></p>', '', '', '11.55637890155878,104.92820978164673,17', 1, 'INDEPENDENCE MONUMENT', '[{"filename":"add_attachment_0_1499248782.jpg","des":""},{"filename":"add_attachment_1_1499248782.jpg","des":""}]', 53, 0, '0.00', '0.00', NULL, NULL, '2017-07-05 16:59:42', 5, '2017-07-14 12:17:06', 1, 1, 5, '2017-07-05 16:59:42', 1, 1),
(66, 288, '373', 'Royal Palace', '<p>The Royal Palace of Cambodia is a complex of buildings although it is generally understood to be the royal abode of the King of Cambodia. The compound was the citadel of King Ponhea Yat (1393-1463) and rebuilt to its present state in 1886, when King Norodom (1834-1904) relocated the royal capital from Oudong to Phnom Penh. The buildings with beautiful towering spires are a great example of classic Khmer architecture found in Cambodia today.</p>\r\n<p>Along with numerous other interesting buildings, within the 183,135 square meter (421m x 435m) compound is of course The Khemarin Palace, known as Prasat Khemarin meaning the &ldquo;Palace of the Khmer King.&rdquo; This is officially the residence of His Majesty, King Norodom Sihamoni.</p>\r\n<p>Tourists can visit the Throne Hall (Preah Tineang Tevea Vinichhay) where coronations and official ceremonies take place, the Temple of the Emerald Buddha (Wat Preah Keo Morakot), Stupas (Chedei), a Royal Dining Hall, the Chan Chhaya Pavilion and a French-style building that was a gift from Napoleon III.</p>\r\n<p>&nbsp;</p>', '', '', '11.563904921094029,104.93124604225159,15', 1, 'Royal Palace', '[]', 0, 0, '0.00', '0.00', NULL, NULL, '2017-07-05 17:31:53', 5, NULL, NULL, 1, 5, '2017-07-05 17:31:53', 1, 0),
(67, 288, '292', 'Kampong Trach Mountain', '<p>This is a charming province commonly visited as a gateway to the Bokor National Park, the beaches of Kep, the beautiful rapids of Toek Chhou and other attractions of southwestern Cambodia. The Province has a relaxed atmosphere; it possesses a quaint, welcoming small town ambiance that is soothing to the soul.</p>\r\n<p>&nbsp;</p>\r\n<p><img src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1499756950.jpg" alt="" width="50%" height="50%" /></p>\r\n<p><img src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_1_1499756950.jpg" alt="" width="50%" height="50%" /></p>\r\n<p><img src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_2_1499756950.jpg" alt="" width="50%" height="50%" /></p>', '', '', '10.591366211613687,104.46487426757812,11', 8, 'Kampot Province', '[{"filename":"add_attachment_0_1499756950.jpg","des":""},{"filename":"add_attachment_1_1499756950.jpg","des":""},{"filename":"add_attachment_2_1499756950.jpg","des":""}]', 81, 0, '0.00', '0.00', NULL, NULL, '2017-07-06 15:55:40', 5, '2017-07-11 14:42:44', 5, 1, 5, '2017-07-06 15:55:40', 1, 1),
(68, 288, '293', 'Toek Chhou Rapids', '<p>This is a charming province commonly visited as a gateway to the Bokor National Park, the beaches of Kep, the beautiful rapids of Toek Chhou and other attractions of southwestern Cambodia. The Province has a relaxed atmosphere; it possesses a quaint, welcoming small town ambiance that is soothing to the soul.</p>\r\n<p>The Bokor National park is popular for its cool mountain climate and remains a year-round favourite amongst locals and foreigners alike. The scenery from the top is captivating especially in the morning hours when one can literally touch the clouds and take in fresh mountain air.</p>\r\n<p>Other attractions include the Popokvil Waterfall where the water charges incessantly to provide a pool at its base for a cool dip.</p>\r\n<p>A short distance across the track, the Toek Chhou Rapids offers yet another popular tourist attraction.</p>', '', '', '10.670729697573023,104.13082122802734,11', 8, 'Kampot Province', '[]', 9, 0, '0.00', '0.00', NULL, NULL, '2017-07-06 16:13:06', 5, '2017-07-14 15:21:44', 5, 1, 5, '2017-07-06 16:13:06', 1, 0),
(69, 288, '293', 'Rolos Thom Natural Attration', '<p>Ra los Thom site has arranged to a natural attraction for tourists, It is located on rank Dangrek Mountain at Phnom Bak point(336 point),about 18km far from the provincial town and it is located in Trapeang Tong village, Sankat Kon Kreal, Samraong city,Oddar Meanchey province. The northwest of Kbal Cheh Sar commune about 6km. Ra Los or eroding ground has shape ground appearing because the surface ground place eroded to big-small sparkling mounds there are water erodes the ditch ground from the top until under wall surface. Some mounds are 6m to 7m high some top mounds there are grasses in rainy season. The all big small mounds and high low mounds have white grey clay like cooked burnt brick. Ra Los or eroding ground consists of many places but it is not strong erodes as Ra Los Thom.</p>\r\n<p>According to the research a number of seniors as Net Yey grandfather. He had 87 years old and he died in 2000. He had origin in Khtum village. Hvat, Kim Hou grandfathers all have known and saw the Ra Los ground or erode ground. Preah Kro Thama Sar Sima Khang Tik, monk chief of Oddar Meanchy Province, resided to stay at Reachea Saraong Monastery province, resided to stay at Reachea Samraong monastery (now died). He had origin at Kbal Sar Chesh near the Ra Los. About 6km.when he was a child, he used to go many times at the Ra Los too.</p>\r\n<p>He said that the erode ground is not changed but the trees, previous time were plentiful big trees and more tropical tree or tiger paw tree (having very hard wood which is used for making stamps),now remains small trees.</p>', '', '', '11.552752465221841,104.91668701171875,12', 22, 'Rolos Thom Natural Attration', '[]', 0, 0, '0.00', '0.00', NULL, NULL, '2017-07-14 15:54:20', 5, NULL, NULL, 1, 5, '2017-07-14 15:54:20', 1, 0),
