(71, 288, '292,293', 'Bousra Waterfall', '<p>The Bousra Waterfall is coneniently sited in Pech Chenda District; 43 kilometters from s&eacute;n Monorom. It can be accessed by red soil road. The waterfall is one of&nbsp;the most interesting places for keen tourists It is divided into three stages:</p>\r\n<p>-First stage: The waterfall has 15-metre diameter and 8-12meters height in the rainy season and 10-15- meter height in the dry season.</p>\r\n<p>-Second stage: The waterfall has 23-meter diameter and 15-20-meter height in the rainy season and 20-meter diameter and 18-25-meter height in the dry season. The season stage of&nbsp; the waterfall has 150-meter distance from the first stage. Tourists have a strong sentimental attachment to the place.</p>\r\n<p>-Third Stage: The waterfall has stronger speed than the second stage. This stage can not be reached because of its location in the thick forest and lack of means of transport.</p>', '', '', '12.566554036770437,107.4189841747284,17', 13, 'Bousra Waterfall', '[]', 0, 0, '0.00', '0.00', NULL, NULL, '2017-07-21 15:25:14', 5, NULL, NULL, 1, 5, '2017-07-21 15:25:14', 1, 0),
(72, 288, '292,293', 'Bousra Waterfall', '<p>The Bousra Waterfall is coneniently sited in Pech Chenda District; 43 kilometters from s&eacute;n Monorom. It can be accessed by red soil road. The waterfall is one of&nbsp;the most interesting places for keen tourists It is divided into three stages:</p>\r\n<p>-First stage: The waterfall has 15-metre diameter and 8-12meters height in the rainy season and 10-15- meter height in the dry season.</p>\r\n<p>-Second stage: The waterfall has 23-meter diameter and 15-20-meter height in the rainy season and 20-meter diameter and 18-25-meter height in the dry season. The season stage of&nbsp; the waterfall has 150-meter distance from the first stage. Tourists have a strong sentimental attachment to the place.</p>\r\n<p>-Third Stage: The waterfall has stronger speed than the second stage. This stage can not be reached because of its location in the thick forest and lack of means of transport.</p>', '', '', '12.566554036770437,107.4189841747284,17', 12, 'Bousra Waterfall', '[{"filename":"maxresdefault_3_1545727624_27530.jpg","des":""}]', 60, 0, '0.00', '0.00', NULL, NULL, '2017-07-21 15:27:49', 5, '2018-12-25 15:47:09', 1, 1, 5, '2017-07-21 15:27:49', 1, 1),
(73, 288, '292,293', 'Kachanh Waterfall', '<p>Locarted in Kachanh Commune, Banlung District, the kachanh Waterfall is 6 Km from the Banlung town. The waterfall is 12 meters in length, wich flow endlesslhy along the Kantoeng Stream to the Sr&eacute; Pork River in Lomphat District.</p>\r\n<p>We call the waterfall ''Kachanh" Because we follow the ethnic minority of kreung in Kachanh Village. Among the stream and rubber planatation, the kachanh Waterfall provides the great scenery for tourists. The stream''s bottom can be acceassed byh a wodden stair having approximately 72 steps. On the side of the top of the waterfall, big trees branching out cast cool shadows over toiurists for picnicking there. On the side of the &nbsp;stream, there is a stand stair built in 1998 for tourists to get on the elephant''s back for their enjoyable riding.</p>\r\n<p>&nbsp;</p>', '', '', '13.692784402546131,106.98958396911621,17', 16, 'Kachanh Waterfall', '[{"filename":"add_attachment_0_1500698571.jpg","des":""},{"filename":"add_attachment_1_1500698571.jpg","des":""}]', 84, 0, '0.00', '0.00', NULL, NULL, '2017-07-22 11:36:23', 5, '2017-08-01 15:59:54', 5, 1, 5, '2017-07-22 11:36:23', 1, 1),
