(75, 288, '290,291', 'Koh Ton Say', '<p>Koh ton say</p>\r\n<p>Koh ton say resort is the natural resort locating at the Southeast of Kep town in 4.5kilometer distance from the town, and has two beaches suitable for swimming because they have white sand and shallow water. At the bottom of the sea, there are varied fish, plant and coral, which enable the research on ecology. It''s such a relaxing place and you''ll soon get down to the slow pace of life on the island. The local people are wonderful and friendly, the seafood is divine, it''s perfect for swimming, there''s things to do or you can simply chill out and kick back.</p>\r\n<p>The main beach on Rabbit Island approximately half a kilometer long. It''s the beach that you arrive on Rabbit Island and you can see Kep across to the mainland. The beach is only a few meters wide , however, there''s room for sun loungers, deck chairs and plenty of hammocks on the trees hugging the shoreline.</p>\r\n<p>For the best gourmet experience, you must eat the yummy and fresh seafood which is cheap available everywhere. Fish, shrimps, crab and squid are offered on all menus and it is all deliciously fresh, and cooked in a variety of styles.</p>\r\n<p>If you love your seafood you''re in for a delight, and it&rsquo;s much cheaper than what you''ll get in kep.</p>\r\n<p>&nbsp;</p>\r\n<p><img src="http://www.visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1516158849.jpg" alt="" width="50%" height="50%" /></p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <img src="http://www.visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1516159056.jpg" alt="" width="50%" height="50%" /></p>', '', '', '10.436517416232137,104.32946172746597,14', 23, 'koh Ton Say', '[{"filename":"add_attachment_0_1516158849.jpg","des":""},{"filename":"add_attachment_0_1516159056.jpg","des":""}]', 38, 0, '0.00', '0.00', NULL, NULL, '2017-08-07 16:16:51', 5, '2018-01-17 10:19:43', 5, 1, 5, '2017-08-07 16:16:51', 1, 1),
(76, 288, '373', 'Tamok House', '<p>In Anlong Veng district, along Road 68, about 100 kilometers east of Oddar Meanchey provincial town, is a house once owned by former Khmer Rouge Commander Ta Mok. From 1979 until late 1997, this area was organized and controlled by the Khmer Rouge armies. Some remaining statues describe the way the rebels lived and how they arranged their troops during their bloody struggle against the government.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Important Points</strong></p>\r\n<p>Many tourists go to Anlong Veng to see and photograph the sites and activities associated with the former regime, and the government has discussed turning this area into a historical site to attract even more tourists. It is the important historical of khmer rouge in Cambodia and Many tourists go to Anlong Veng to see and photograph the sites and activities associated with the former regime, and the government has discussed turning this area into a historical site to attract even more tourists.</p>', '', '', '14.241256624590266,104.08018112182617,13', 22, 'tamok house', '[{"filename":"img_1243_1_1545727983_55621.jpg","des":""}]', 47, 0, '0.00', '0.00', NULL, NULL, '2017-08-28 17:14:05', 5, '2018-12-25 15:53:08', 1, 1, 5, '2017-08-28 17:14:05', 1, 1),
(77, 288, '373', 'O''Smach', '<p>O&rsquo; Smach was the scene of heavy fighting in 1997 as the remnants of Sihanouk? Is forces battled opposing forces. Peace came in 1998 and the military evicted local residents and sold off the land to the casino developers.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Important Points</strong></p>\r\n<p>O''Smach is on the Cambodian-Thai border, about 41 kilometers north of Oddar Meanchey provincial town. The town features a resort which includes a number of casinos, good restaurants and luxury hotels. The resort has been organized by the Royal Group and VIP Shop Group companies.The O Smach Resort has an impressive entry complete with a giant glowing green lotus set in a fountain. The resort has beautifully maintained grounds which feature, for some unknown reason, two military armoured vehicles decorated with Christmas lights. The O Smach resort has a casino and 198 hotel rooms and suites. Room facilities include satellite TV, aircon, en suite, mini bar etc.The resort facilities include a restaurant, 24 hour coffee shop, swimming pool, gym, sauna and massage parlour. Across the road is the Royal Hill Resort, offering yet another casino and hotel complex.</p>\r\n<p>O&rsquo; Smach was the scene of heavy fighting in 1997 as the remnants of Sihanouk? Is forces battled opposing forces. Peace came in 1998 and the military evicted local residents and sold off the land to the casino developers.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Important Points</strong></p>\r\n<p>O''Smach is on the Cambodian-Thai border, about 41 kilometers north of Oddar Meanchey provincial town. The town features a resort which includes a number of casinos, good restaurants and luxury hotels. The resort has been organized by the Royal Group and VIP Shop Group companies.The O Smach Resort has an impressive entry complete with a giant glowing green lotus set in a fountain. The resort has beautifully maintained grounds which feature, for some unknown reason, two military armoured vehicles decorated with Christmas lights. The O Smach resort has a casino and 198 hotel rooms and suites. Room facilities include satellite TV, aircon, en suite, mini bar etc.The resort facilities include a restaurant, 24 hour coffee shop, swimming pool, gym, sauna and massage parlour. Across the road is the Royal Hill Resort, offering yet another casino and hotel complex.</p>', '', '', '14.409787787093093,103.6964028555667,13', 22, 'O''Smach', '[]', 16, 0, '0.00', '0.00', NULL, NULL, '2017-08-31 14:57:20', 5, '2018-01-17 10:08:58', 5, 1, 5, '2017-08-31 14:57:20', 1, 0),
(78, 288, '373', 'Phnom Yat', '<p>Phnom Yat is a cultural and historical site located in Pailin City. It is not a holy place where people come to worship, but also the heart of Pailin City. The mountain is 60 meters high, 700 meters long, 300 meters wide and covers 30, 000 square meters. The top is accessible on foot or by vehicle. A staircase of 242 steps, each step about 25 centimeters high, was completed on Oct 13, 1998. The site includes an old pagoda similar to Kola pagoda. It was built on the hilltop by the Kola people in 1922. There are many ancient structures on Phnom Yat, including the big and small stupas and Asroms (the hermitage, a place for meditating). The area holds many superstitions for Pailin residents and some visitors.Although a wealth of gems already have been mined in Pailin, the hill is still believed to hold more. Many kiosks, or small cottages, are available for visitors to relax in on the mountaintop.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Important Points</strong></p>\r\n<p>Phnom Yat Resort, Pailin City is one of the renowned historical and cultural sites that have attracted large crowds of tourists. The first thing that one notices about this particular pagoda is that it uses a wide range of and innumerable precious stones. Previously locales and passersby were the only visitors but now with the increase in the number of tourists there are more people who go to the Phnom Yat Resort, Pailin CityPhnom Yat Resort, Pailin City is especially well known for the Ko La style pagoda. Besides the pagoda which is the central attraction there is a stupa. The stupa is placed behind the pagoda. This has served as the cemetery for Rattanak Sambat, the father of Cambodian literary figure, Khun Niery. It is believed that their ashes are preserved here.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><img src="http://www.visitcambodia.travel/upload/post_attachment/resized/add_attachment_0_1515989818.jpg" alt="" width="50%" height="50%" /></p>', '', '', '12.846459584600183,102.61098845498054,15', 24, 'Phnom Yat', '[{"filename":"2f6347871a7b463e944e043baf91feda205e5a98_1545727592_9826.jpg","des":""}]', 44, 0, '0.00', '0.00', NULL, NULL, '2017-08-31 16:48:54', 5, '2018-12-25 15:46:34', 1, 1, 5, '2017-08-31 16:48:54', 1, 1),
(79, 289, '309', 'AEON MALL Phnom Penh', '<p>With spacious and good location, Daylight Plaza (Ground Floor), Lively Plaza (Ground Floor, First Floor), River Front Plaza (First Floor).<br />The space will be ideal for events and promotion activities. AEON MALL would like to inform you information of space for rent.</p>\r\n<h2>Daylight Plaza (Ground Floor)</h2>\r\n<p>Daylight Plaza-Ground Floor (Whole area)</p>\r\n<ul class="listStyle">\r\n<li>Site Area : 22m x 16m</li>\r\n<li>Height : Approx. 27 m</li>\r\n</ul>\r\n<table width="100%">\r\n<tbody>\r\n<tr>\r\n<th scope="col"><img src="http://aeonmallphnompenh.com/files/image/63/pic.jpg" alt="" width="100%" /></th>\r\n<th scope="col"><img src="http://aeonmallphnompenh.com/files/image/64/pic.gif" alt="" width="100%" /></th>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h2>Lively Plaza (Ground Floor)</h2>\r\n<p>Lively Plaza-Ground Floor (Whole area)</p>\r\n<ul class="listStyle">\r\n<li>Site Area : 20m x 12m</li>\r\n<li>Height : Approx. 16 m</li>\r\n</ul>\r\n<table width="100%">\r\n<tbody>\r\n<tr>\r\n<th scope="col"><img style="width: 100%;" src="http://aeonmallphnompenh.com/files/image/65/pic.jpg" alt="" /></th>\r\n<th scope="col"><img style="width: 100%;" src="http://aeonmallphnompenh.com/files/image/66/pic.gif" alt="" /></th>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h2>Lively Plaza (First Floor)</h2>\r\n<p>Lively Plaza-First Floor (Whole area)</p>\r\n<ul class="listStyle">\r\n<li>Site Area : 11.5m x 4.5m</li>\r\n</ul>\r\n<table width="100%">\r\n<tbody>\r\n<tr>\r\n<th scope="col"><img style="width: 100%;" src="http://aeonmallphnompenh.com/files/image/67/pic.jpg" alt="" /></th>\r\n<th scope="col"><img style="width: 100%;" src="http://aeonmallphnompenh.com/files/image/68/pic.gif" alt="" /></th>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h2>River Front (First Floor)</h2>\r\n<p>Riverfront Plaza-First Floor (Whole Area)</p>\r\n<ul class="listStyle">\r\n<li>Site Area : 8.5m x 6m</li>\r\n</ul>\r\n<table width="100%">\r\n<tbody>\r\n<tr>\r\n<th scope="col"><img style="width: 100%;" src="http://aeonmallphnompenh.com/files/image/69/pic.jpg" alt="" /></th>\r\n<th scope="col"><img style="width: 100%;" src="http://aeonmallphnompenh.com/files/image/70/pic.gif" alt="" /></th>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h4>Note:</h4>\r\n<ul class="listStyle">\r\n<li>AEON MALL does not offer service of carrying and stock equipment.</li>\r\n<li>For consultation and fee information, please contact:<br />LY RATHANAK<br />Position: Senior Account Supervisor<br />Tel: 098 980 507<br />Email: <a href="mailto:rathanak@hybrid-ad.biz" target="_blank" rel="noopener noreferrer">rathanak@hybrid-ad.biz</a></li>\r\n</ul>\r\n<h2>AEON HALL</h2>\r\n<p>AEON HALL is where you can register to organize local or international activities such as exhibition, presentation, conference, training, etc.</p>\r\n<p>Daylight Plaza, First Floor</p>\r\n<ul class="listStyle">\r\n<li>Size: 35.58m x 8.765m</li>\r\n<li>2 LCD projectors</li>\r\n<li>Chairs and Table</li>\r\n<li>Participator : Approx. 300 people</li>\r\n</ul>\r\n<p><img src="http://aeonmallphnompenh.com/files/image/71/pic.jpg" alt="" width="100%" /></p>\r\n<p><img src="http://aeonmallphnompenh.com/files/image/72/pic.jpg" alt="" width="100%" /></p>\r\n<p><img src="http://aeonmallphnompenh.com/files/image/73/pic.png" alt="" width="100%" /></p>\r\n<h2>Meeting Room</h2>\r\n<p>Meeting Room is where you can register to organize local or international activities such as exhibition, presentation, conference, training, etc.<br />Daylight Plaza, First Floor</p>\r\n<ul class="listStyle">\r\n<li>Size: 12.74m x 6.85m</li>\r\n<li>1 LCD projector</li>\r\n<li>Chairs and Table</li>\r\n<li>Participator : Approx. 100 people</li>\r\n</ul>\r\n<table width="100%">\r\n<tbody>\r\n<tr>\r\n<th scope="col"><img style="width: 100%;" src="http://aeonmallphnompenh.com/files/image/74/pic.png" alt="" /></th>\r\n<th scope="col"><img style="width: 100%;" src="http://aeonmallphnompenh.com/files/image/75/pic.png" alt="" /></th>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><img src="http://aeonmallphnompenh.com/files/image/76/pic.png" alt="" width="100%" /></p>', '<p><img src="http://aeonmallphnompenh.com/files/image/61/pic.jpg" alt="" width="100%" /></p>', '<p>For consultation and fee information, please contact:<br />LY RATHANAK<br />Position: Senior Account Supervisor<br />Tel: 098 980 507<br />Email: <a href="mailto:rathanak@hybrid-ad.biz" target="_blank" rel="noopener noreferrer">rathanak@hybrid-ad.biz</a></p>', '11.548316586546381,104.93252277374268,13', 1, '#132,Street Samdach Sothearos, Sangkat Tonle Bassac,Khan Chamkarmon', '[{"filename":"add_attachment_0_1493284558.jpg","des":"AEON MALL Phnom Penh"},{"filename":"add_attachment_0_1493285524.jpg","des":""},{"filename":"add_attachment_0_1493285623.jpg","des":""}]', 121, 0, '0.00', '0.00', NULL, NULL, '2017-04-27 16:15:58', 1, '2017-05-02 14:43:34', 1, 1, 1, '2017-04-28 00:00:00', 1, 1),
(80, 289, '309', 'TK Avenue', '<p><img style="float: right; margin: 0px 0px 10px 10px;" src="http://visitcambodia.localhost/upload/post_attachment/resized/add_attachment_2_1493372993.jpg" alt="" width="50%" />The <strong>TK Avenue Mall</strong> opened in late December 2013 in Phnom Penh&rsquo;s Toul Kork district. TK Avenue is not a Mall in the conventional meaning it is more like a cluster of shops under open air. The shops, restaurants and the cinema complex are scattered over the area of about three blocks. In the middle of the shopping area is a court where people met and sit down on park benches. At the south end of the court is a small children&rsquo;s playground located. The atmosphere at TK Avenue Mall is relaxed and it feels like being out of Phnom Penh as the style of the mall is completely new to Cambodia. Most of the shops at TK Avenue are occupied by rather high end brands which are targeting the upper class in Phnom Penh.</p>\r\n<p>Here is a list of tenants who occupy a store at the <strong>TK Avenue Mall</strong>:<br />Adidas, Pedro footwear and accessories, K Four, Samsung, Mango, Xzara, Aussino furniture, Shiseido, Neck &amp;Neck and more. The prices in these shops are clearly not for the ones with a small budget. If you are short of cash, most of the shops do accept payments by credit cards and plenty of ATMs are available at the Mall.</p>\r\n<h3>Restaurants at TK Avenue</h3>\r\n<p>Those who are hungry will not be disappointed by what the TK Avenue as to offer. Like at any other shopping center in Phnom Penh you can find here several restaurants such as:<br />Lucky Burger, The Pizza Company, Metro Azura, Master Suki Soup and Master Grill, Snow Yogurt, Toto BBQ, Dim Sum Emperor, Brown Coffee, Chatime and a Bakery.</p>\r\n<h3>Cinema TK Avenue Mall</h3>\r\n<p>The <a title="Legend Cinema" href="http://www.legend.com.kh/Ticketing/ShowTime.aspx" target="_blank">Legend Cinema</a> has opened its 3rd branch at the TK Avenue Toul Kork with 3 halls showing movies, which start as late as midnight. No other cinema in Phnom Penh shows movies which start that late.</p>\r\n<h3>Special Shops at TK Avenue</h3>\r\n<p>It comes to no surprise that the TK Avenue Mall houses a branch of Cambodia&rsquo;s no. 1 grocery chain: Lucky Supermarket. You also can find a beauty salon, a branch of Smart phone shop, a flower shop, a shop selling perfume and cosmetics and a pharmacy. The Romanson watch retailer offers not only their own watches but also offers other high end watches and sunglasses from Switzerland.</p>', '<p>We suggest you take a Tuk Tuk as it is the easiest way</p>', '<p>Daily from 7:00am to 5:00pm</p>', '11.583537577226958,104.89907026290894,16', 1, 'No. 80, St. 315, corner of St. 516, 12151 Phnom Penh.', '[{"filename":"add_attachment_0_1493372992.jpg","des":""},{"filename":"add_attachment_1_1493372993.jpg","des":""},{"filename":"add_attachment_2_1493372993.jpg","des":""}]', 61, 0, '0.00', '0.00', NULL, NULL, '2017-04-28 16:49:52', 4, '2018-12-28 17:01:12', 1, 1, 1, '2018-12-28 17:01:08', 1, 1),
