(84, 288, '292,294', 'ភ្នំជីសូរ', '<p>សំណង់នៃប្រាង្គប្រាសាទ បុរាណជាមរតក វប្បធម៌ខ្មែរដ៏មានតម្លៃដោយមិនអាច កាត់ថ្លៃបានឡើយ។ លក្ខណៈពិសេសនៃបុរាណដ្ឋាននេះគេតែងមានការកត់សំគាល់នូវប្រវត្តិនៃការកសាងពីរ បែបខុសគ្នា គឺតាមរយៈអ្នកបុរាណវិទ្យាធ្វើការសិក្សាស្រាវជ្រាវតាម រយៈសិលាចារឹកផង និងមួយបែបទៀតតាមរយៈរឿងព្រេង និទានដែលប្រជាពលរដ្ឋរស់នៅតំបន់ជុំវិញប្រាសាទមានការចេះចាំមាត់ហើយបាននិយាយតៗ គ្នាផង។ តាមសិលាចារឹក លើភ្នំជីសូរ មានឈ្មោះថា ស្រីសូរ្យបព៌ត ឫ សូរ្យបព៌ត ដែលមានន័យថា ភ្នំរបស់ព្រះបាទសូរ្យវរ្ម័នទី១។នៅក្នុងប្រាសាទភ្នំជីសូរមាន សិលាចារឹកពីរ សិលាចារឹកទីមួយនិយាយពីការថ្វាយគ្រឿងសក្ការៈបូជានានា ចំពោះអាទិទេពនៅលើភ្នំដែលមានឈ្មោះថា នៅសូរ្យបព៌ត ដែលមានន័យថា ភ្នំសូរ្យ នៅក្នុងឆ្នាំ ១០១៩ នៃគ្រិស្តសករាជ។ ចំនែកឯសិលាចារឹកមួយទៀតគឺសិលាចារឹកទីពីរ បានអធិប្បាយពីរាជវង្សរបស់ព្រះបាទសូរ្យវរ្ម័នទី២ ដែលជាអាយ្យកាអាយ្យកោរបស់ព្រះអង្គគឺជាកូនចៅរបស់ស្ដេចហិន្យវរ្ម័ន។</p>', '<p>ភ្នំជីសូរ ស្ថិតនៅភូមិស្លា ឃុំរៀង ស្រុកសំរោង ខេត្តតាកែវ។ បើធ្វើដំណើរតាមរថយន្ត ពីភ្នំពេញទៅច្រកភ្នំឌិន (ច្រកព្រុំដែនអន្ដរជាតិកម្ពុជានិងវៀតណាម) តាមផ្លូវជាតិលេខ២ កាត់តាមក្រុងតាខ្មៅ ស្រុកកណ្ដាលស្ទឹង ស្រុកបាទី និង ប្រាសាទនាងខ្មៅ មានចំងាយ ៦២ គីឡូម៉ែត្រ ដោយប្រើរយៈពេលប្រហែលមួយម៉ោង រួចបត់ស្តាំចូលតាមផ្លូវលំមួយមានចំងាយ៥ គីឡូម៉ែត្រ ពីផ្លូវជាតិ។ បើធ្វើដំណើរពីទីរួមខេត្តមានចំងាយ ២៧ គីឡូម៉ែត្រ។ ភ្នំជីសូរមាន កំពស់ ១៣០ ម៉ែត្[៤]រ។</p>', '<p>ដើម្បីធ្វើដំណើរទៅកាន់ភ្នំជីសូរ គេអាចប្រើប្រាស់មធ្យោបាយពីរបែប តាមរយៈផ្លូវជាតិលេខ២ និងតាមរយៈផ្លូវដែកភ្នំពេញកំពង់សោម បន្ទាប់មកដល់បំបែកថ្នល់ទទឹង ភ្ញៀវទេសចរអាចបន្តដំណើរតាមផ្លូវថ្នល់កៅស៊ូ កាត់តាមផ្សារបត់រកា បន្តិចយើង និងមកដល់ភ្នំជីសូរ។ នៅពេលភ្ញៀវទេសចរធ្វើដំណើរតាមផ្លូវជាតិលេខ២ ពេលមកដល់ស្ពានដែកដែលជាព្រុំកំណត់រវាងស្រុកកណ្ដាលស្ទឹងនៃខេត្តកណ្ដាលនិងស្រុកបាទីនៃខេត្តតាកែវ ភ្ញៀវទេសចរនិងមានអាម្មណ៍ថាខេត្តតាកែវមានការអភិវឌ្ឍន៍យ៉ាងជឿនលឿនគ្រប់វិស័យដូចជា វិស័យគេហដ្ឋារចនាសម្ព័ន្ឋផ្លូវថ្នល់ វិស័យសុខាភិបាល វិស័យកសិកម្ម វិស័យឧស្សាហកម្ម វិស័យអប់រំ និងផ្នែកពុទ្ឋចក្រផងដែរ។</p>', '11.184942133798598,104.82632991667788,14', 21, 'ភូមិចន្លាត់ដៃ ឃុំរវៀង ស្រុកសំរោង', '[{"filename":"maxresdefault_1_1545727332_80194.jpg","des":""},{"filename":"maxresdefault_2_1545727335_94455.jpg","des":""}]', 0, 0, '0.00', '0.00', NULL, NULL, '2018-12-17 14:49:29', 1, '2018-12-28 16:59:08', 1, 1, 1, '2018-12-28 16:59:03', 1, 0);
