(1, 2, 1, 'សណ្ឋាគារភ្នំពេញ', '<h3>មជ្ឈមណ្ឌល​ពាណិជ្ជកម្ម</h3>\r\n<p>សម្រាប់ទាំងអស់ការិយាល័យរបស់អ្នក, ដំណឹងនិងពត្រូវការខណៈដែលសូម្បីតែនៅលើថ្ងៃឈប់សម្រាក។ មជ្ឈមណ្ឌលពាណិជ្ជកម្មសណ្ឋាគារភ្នំពេញគឺបើកចំហ 24 ម៉ោងដើម្បីផ្តល់នូវការចូលដំណើរការអ៊ិនធឺណិ, សរសេរសំបុត្រ, សារផ្ញើនិងរួមគ្នាជាមួយនឹងការជួបប្រជុំសមត្ថភាពបន្ទប់ 10 នាក់។ សណ្ឋាគាររបស់យើងយល់ថាសូម្បីតែខណៈពេលដែលថ្ងៃវិស្សមកាល, ភ្ញៀវត្រូវទៅស្នាក់នៅក្នុងការទំនាក់ទំនងជាមួយផលប្រយោជន៍អាជីវកម្មរបស់ពួកគេទៅស្នាក់នៅពេលខាងមុខនៃពិភពអាជីវកម្ម។</p>\r\n<h3>ហាងលក់វត្ថុអនុស្សាវរីយរាជធានីភ្នំពេញ</h3>\r\n<p>ដំណើរទស្សនកិច្ចទៅប្រទេសកម្ពុជាត្រូវបានធ្វើឱ្យល្អឥតខ្ចោះដោយការជ្រើសរើសពីការជាច្រើននៃគ្រឿងអលង្ការកំប៉ិកកំប៉ុកសូត្រនិងប្រាក់មានតម្លៃនិងស្រុកប្រកបដោយសិល្បៈនៅឯហាងលក់វត្ថុអនុស្សាវរីយរាជធានីភ្នំពេញ។ ខាងក្រោមនេះជាបេតិកភ័ណ្ឌមានភាពវ័យឆ្លាតនៃសិប្បកម្មកម្ពុជាត្រូវបានដាក់តាំងបង្ហាញជាមួយនឹងការតែមួយគត់ដែលល្អបំផុតនិងល្អបំផុតដែលអាចប្រើបាន។</p>\r\n<h3>ហាងអ៊ុតសក់និងផាត់មុខ</h3>\r\n<p>នៅក្នុងការបញ្ចេញមតិនៃការថែរក្សាសម្ផស្ស, ទទួលបាន pampered ដូចជាព្រះនាងមួយនិងការចូលរួមទៅនឹងតម្រូវការសម្អិតសម្អាងខ្លួននៃរាងកាយរបស់អ្នកកែសម្ផស្សនៅកម្ពុជាជាការបានតែអាចធ្វើបានសម្រាប់អ្នក។<br />ទទួលបានសក់របស់អ្នកធ្វើឱ្យស្រស់ពីភាពតានតឹងឬការគូសបញ្ជាក់នៅក្នុងវិធីដែលមានតែអាចជួយនាំមកនូវភាពស្រស់ស្អាតផ្នែកខាងក្នុងរបស់អ្នក។<br /><br />អ្នកជំនាញថែរក្សាសម្ផស្សនៅប្រទេសកម្ពុជាដែលមានជំនាញវិជ្ជាជីវៈគឺមានវត្តមានចូលរួមដូចជាការព្យាបាលជើងដោយប្រើលម្អិត manicured ថាភ្ញៀវទេសចរនិងជាញឹកញាប់នៅក្នុងតម្រូវការនៃការបន្ទាប់ពីវិស្សមកាលមួយថ្ងៃរឹងរបស់។<br /><br />ព្យាបាលដោយខ្លួនឯងទៅតាមតម្រូវការណាល្អនៃភាពស្រស់ស្អាតនិងផ្ដល់ជីវិតឱ្យកាន់តែច្រើននៅថ្ងៃឈប់សម្រាករបស់អ្នកដោយផ្តល់អោយខ្លួនឯងមើលទៅបានធ្វើឱ្យស្រស់ថ្មី។</p>\r\n<h3>KTV កំសាន្ត</h3>\r\n<p>មាសក្លឹបខារ៉ាអូខេជាសតវត្សទីកន្លែងដើម្បីជាការអស់មួយយប់ជាមួយមិត្តភក្តិរាំនិងច្រៀងចម្រៀងដែលអ្នកចូលចិត្តជាមួយភ្ញៀវនៅបារ៍គួរអោយទាក់ទាញនេះ។ ក្លឹបសតវត្សមាសមានប្រព័ន្ធសំឡេងចុងក្រោយបំផុតនិងការជ្រើសរើសបទចម្រៀងដូចផ្សេងទៀតទេ។ ក្រុម Philippino ទេពកោសល្យសប្បាយរីករាយពេលយប់ជាមួយឈុតធំទូលាយមួយនៃតន្ត្រីដែលជា well.For ទាំងអស់ការិយាល័យរបស់អ្នក, ដំណឹងនិងពត្រូវការសូម្បីតែខណៈពេលនៅលើថ្ងៃឈប់សម្រាក។ មជ្ឈមណ្ឌលពាណិជ្ជកម្មសណ្ឋាគារភ្នំពេញគឺបើកចំហ 24 ម៉ោងដើម្បីផ្តល់នូវការចូលដំណើរការអ៊ិនធឺណិ, សរសេរសំបុត្រ, សារផ្ញើនិងរួមគ្នាជាមួយនឹងការជួបប្រជុំសមត្ថភាពបន្ទប់ 10 នាក់។ សណ្ឋាគាររបស់យើងយល់ថាសូម្បីតែខណៈពេលដែលថ្ងៃវិស្សមកាល, ភ្ញៀវត្រូវទៅស្នាក់នៅក្នុងការទំនាក់ទំនងជាមួយផលប្រយោជន៍អាជីវកម្មរបស់ពួកគេទៅស្នាក់នៅពេលខាងមុខនៃពិភពអាជីវកម្ម។</p>', '<p>សម្រាប់ទាំងអស់ការិយាល័យរបស់អ្នក, ដំណឹងនិងពត្រូវការខណៈដែលសូម្បីតែនៅលើថ្ងៃឈប់សម្រាក។ មជ្ឈមណ្ឌលពាណិជ្ជកម្មសណ្ឋាគារភ្នំពេញគឺបើកចំហ 24 ម៉ោងដើម្បីផ្តល់នូវការចូលដំណើរការអ៊ិនធឺណិ, សរសេរសំបុត្រ, សារផ្ញើនិងរួមគ្នាជាមួយនឹងការជួបប្រជុំសមត្ថភាពបន្ទប់ 10 នាក់។ សណ្ឋាគាររបស់យើងយល់ថាសូម្បីតែខណៈពេលដែលថ្ងៃវិស្សមកាល, ភ្ញៀវត្រូវទៅស្នាក់នៅក្នុងការទំនាក់ទំនងជាមួយផលប្រយោជន៍អាជីវកម្មរបស់ពួកគេទៅស្នាក់នៅពេលខាងមុខនៃពិភពអាជីវកម្ម។</p>', '<p>ទូរស័ព្ទ: +855 (0) 23 991 868<br />ទូរសារ: +855 (0) 23 991 818<br />E-mail: info@phnompenhhotel.com</p>', 'លេខ 53 មហាវិថីព្រះមុនីវង្សសង្កាត់ស្រះចុកសំបុត្រ ប្រអប់ 1131, រាជធានីភ្នំពេញព្រះរាជាណាចក្រកម្ពុជា', 106, '2017-03-24 10:54:19', 1, '2017-04-19 16:40:10', 1, 1),
(2, 18, 1, 'ទិវាសិទ្ធនារីអន្តរជាតិ', '<p>ទិវានារីអន្តរជាតិ (International Women''s Day) ដែលជាទូទៅនៅក្នុងប្រទេសកម្ពុជា ត្រូវបានគេហៅថា ទិវាសិទ្ធនារីនោះ តែងតែប្រារព្ធធ្វើឡើងនៅថ្ងៃទី០៨ ខែមីនា ជារៀងរាល់ឆ្នាំ។ នៅក្នុងតំបន់ផ្សេងគ្នា ទិវានេះក៏ត្រូវបានប្រារព្ធឡើង ក្នុងអត្ថន័យផ្សេងៗគ្នាដែរ ក្នុងនោះមានដូចជា ​ដើម្បីបង្ហាញ​​ពីការគោរព ការកោតសរសើរ និងក្តីស្រឡាញ់ចំពោះ​ស្រី្ត ដើម្បី​អបអរសាទរចំពោះសមិទ្ធផលនានា ដែលស្ត្រីសម្រេចបាន ដូចជាផ្នែកសេដ្ឋកិច្ច នយោបាយ​និងសង្គមជាដើម។</p>\r\n<p>ដំបូងឡើងទិវានេះត្រូវបានផ្តើមប្រារព្ធឡើងក្នុងទម្រង់បែបសង្គម និងនយោបាយតែប៉ុណ្ណោះ ប៉ុន្តែក្រោយមកវាត្រូវបាន​បូកបញ្ជូលជាមួយនឹងវប្បធម៌ ដែលមានលក្ខណៈខុសៗគ្នា ទៅតាមបណ្តាប្រទេសនីមួយៗទូទាំងពិភពលោក។</p>', '<p>Transportation Info ដំបូងឡើងទិវានេះត្រូវបានផ្តើមប្រារព្ធឡើងក្នុងទម្រង់បែបសង្គម និងនយោបាយតែប៉ុណ្ណោះ ប៉ុន្តែក្រោយមកវាត្រូវបាន​បូកបញ្ជូលជាមួយនឹងវប្បធម៌ ដែលមានលក្ខណៈខុសៗគ្នា ទៅតាមបណ្តាប្រទេសនីមួយៗទូទាំងពិភពលោក។</p>', '<p>Contact Info ដំបូងឡើងទិវានេះត្រូវបានផ្តើមប្រារព្ធឡើងក្នុងទម្រង់បែបសង្គម និងនយោបាយតែប៉ុណ្ណោះ ប៉ុន្តែក្រោយមកវាត្រូវបាន​បូកបញ្ជូលជាមួយនឹងវប្បធម៌ ដែលមានលក្ខណៈខុសៗគ្នា ទៅតាមបណ្តាប្រទេសនីមួយៗទូទាំងពិភពលោក។</p>', 'ខេត្តព្រះស៊ីហនុ', 69, '2017-03-29 14:32:27', 1, NULL, NULL, 1),
(3, 20, 1, 'ពិធីបុណ្យ​វិសាខបូជា', '<p>​ថ្ងៃ ១៥​កើត ខែ​ពិសាខ គឺ​ជា​ទិវា​ដែល​ពុទ្ធសាសនិកជន​នៅ​ទូទាំង​សកលលោក​តែង​នាំ​គ្នា​ប្រារព្ធ​ពិធី​បុណ្យ​ដ៏​សំខាន់​មួយ គឺ​វិសាខបូជា។</p>\r\n<p>ប្រការ​ដ៏​សំខាន់​មួយ​ទៀត គឺ​អង្គការ​សហប្រជាជាតិ​បាន​ប្រកាស​នៅ​ថ្ងៃ​ទី​១៥ ខែ​ធ្នូ ឆ្នាំ​១៩៩៩ ទទួល​ស្គាល់​វិសាខបូជា​ជា​ពិធីបុណ្យ​អន្តរជាតិ​មួយ ដែល​គេ​អាច​ប្រារព្ធ​ធ្វើ​នៅ​តាម​ការិយាល័យ​ទាំង​ឡាយ​របស់​អង្គការ​សហប្រជាជាតិ​នៅ​លើ​​ភពលោក។</p>\r\n<p>តើ​ពិធីបុណ្យ​វិសាខបូជា​មាន​អត្ថប្រយោជន៍​យ៉ាង​ណា​សម្រាប់​មនុស្សជាតិ​ទូទៅ ទើប​អង្គការ​សហប្រជាជាតិ​ទទួល​ស្គាល់​ជា​ទិវា​បុណ្យ​របស់​ខ្លួន?</p>\r\n<p>វិសាខបូជា ឬ​ពិសាខបូជា គឺ​ជា​ពិធីបុណ្យ​ដែល​ពុទ្ធសាសនិក​ចាត់​ទុក​ថា មាន​សារសំខាន់​បំផុត​មួយ​ក្នុង​ចំណោម​បុណ្យ​ដទៃ​ទៀត​នៃ​ព្រះពុទ្ធ​សាសនា ពីព្រោះ​ជា​ការ​គោរព រំឭក​នឹក​ដល់​ព្រឹត្តិការណ៍​ធំៗ​បី​នា​សម័យកាល​របស់​ព្រះសម្មាសម្ពុទ្ធ​សមណគោតម គឺ​ថ្ងៃ​ដែល​ព្រះអង្គ​ទ្រង់​ប្រសូត បាន​ត្រាស់​ដឹង និង​បរិនិព្វាន។ ព្រឹត្តិការណ៍​ទាំង​បី​នេះ គឺ​កើតឡើង​នៅ​ចំ​ថ្ងៃ ១៥​កើត ពេញបូណ៌មី ដែល​មាន​ព្រះចន្ទ​ពេញ​វង់ ក្នុង​ខែ​ពិសាខ ដូច​គ្នា ខុស​តែ​ឆ្នាំ​ប៉ុណ្ណោះ។</p>', '<p>កម្មវិធីនេះប្រារព្វតាមវត្តអារាមក្នុងព្រះរាជាណាចក្រកម្ពុជា</p>', '<p>លោកអ្នកទាក់ទៅកាន់ក្រសួងធម្មការ និងសាសនា ឬស្ថាប័នពាក់ព័ន្ធ សម្រាប់ព័ត៌មានបន្ថែម</p>', 'តាមបណ្តាខេត្តក្រុង', 34, '2017-03-29 16:33:38', 1, NULL, NULL, 1),
(4, 8, 2, 'Romdeng Restaurant', '<h2>A true taste of Cambodia<img style="float: right; margin: 0px 0px 10px 10px;" src="http://dev.visitcambodia.travel/upload/post_attachment/resized/add_attachment_3_1490258493.jpg" alt="" width="50%" /></h2>\r\n<p>Romdeng celebrates the good things in life &ndash; family, food and tradition. <br /><br /><br />Plating up truly traditional recipes to creative Cambodian cuisine, our menu will be sure to satisfy your longing for local food. <br /><br />Set in a beautiful colonial building surrounded by a lush garden and swimming pool, Romdeng is the ideal spot to escape.</p>\r\n<p>The best things are found in the most unexpected places. Tucked away on Street 174 you will find our Cambodian&nbsp;<a href="http://friends-international.org/ourprojects/hospitality.asp?mainmenu=ourprojects&amp;page=fsb" target="_blank" rel="noopener">training restaurant</a>, Romdeng, run by former street youth in training. Set in a beautiful colonial building, Romdeng serves a great variety of Cambodian food ranging from almost forgotten recipes from the provinces to contemporary creative Cambodian cuisine. Allow yourself some time to enjoy the pool and free WIFI. Romdeng can also provide catering for weddings, functions and parties and can host events for up to 160 people. Special lunch set menu every day.</p>', '<p>Romdeng is located on <a href="http://www.yourphnompenh.com/street-174-oknha-ket/">Street 174 (Oknha Ket)</a> with house number #74 in <a href="http://www.yourphnompenh.com/phsar-thmei-3-commune/">Phsar Thmei 3 Commune</a>, <a href="http://www.yourphnompenh.com/daun-penh-district/">Daun Penh District</a>, Phnom Penh, Cambodia.</p>', '<p><strong>T</strong> +855 92 219 565<br /><strong>E</strong> <a href="mailto:contact@romdeng-restaurant.org?subject=TREE%20Alliance%20Website" target="_blank" rel="noopener">contact@romdeng-restaurant.org</a></p>', 'ទីតាំង: ភ្នំពេញ អាស័យដ្ឋាន: # 74 ផ្លូវ 174, ភ្នំពេញ, កម្ពុជា', 70, '2017-03-23 15:57:34', 1, '2018-12-27 15:37:32', 1, 1),
